100.jpg\" class=\"attachment-thumbnail size-thumbnail\" alt=\"\" /></a>\n<a href=\"https://poststatus.com/photos-post-status-publish-wordcamp-us-2016/wcus-2016-171/\"><img width=\"150\" height=\"100\" src=\"https://cdn.poststatus.com/wp-content/uploads/2016/12/wcus-2016-171-150x100.jpg\" class=\"attachment-thumbnail size-thumbnail\" alt=\"\" /></a>\n<a href=\"https://poststatus.com/photos-post-status-publish-wordcamp-us-2016/wcus-2016-174/\"><img width=\"150\" height=\"100\" src=\"https://cdn.poststatus.com/wp-content/uploads/2016/12/wcus-2016-174-150x100.jpg\" class=\"attachment-thumbnail size-thumbnail\" alt=\"\" /></a>\n<a href=\"https://poststatus.com/photos-post-status-publish-wordcamp-us-2016/wcus-2016-173/\"><img width=\"100\" height=\"150\" src=\"https://cdn.poststatus.com/wp-content/uploads/2016/12/wcus-2016-173-100x150.jpg\" class=\"attachment-thumbnail size-thumbnail\" alt=\"\" /></a>\n\n<p>I&#8217;ll have more coverage of both Publish and WordCamp US for Post Status Members in the coming days. In the meantime, I hope you enjoy the pictures! If you&#8217;d like to use any of them, you are free to do so, and while credit is not required, it&#8217;s always appreciated.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 08 Dec 2016 20:49:38 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:38;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"WPTavern: GoDaddy Acquires WP Curve, Aims to Become a One-Stop Shop for WordPress Professionals\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=64287\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:105:\"https://wptavern.com/godaddy-acquires-wp-curve-aims-to-become-a-one-stop-shop-for-wordpress-professionals\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5040:\"<p><a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/09/godaddy-logo.jpg?ssl=1\"><img src=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/09/godaddy-logo.jpg?resize=680%2C295&ssl=1\" alt=\"\" class=\"aligncenter size-full wp-image-61236\" /></a></p>\n<p><a href=\"https://wpcurve.com/\" target=\"_blank\">WP Curve</a>, a WordPress services business that focuses on completing small jobs for customers, <a href=\"https://wpcurve.com/wp-curve-joins-godaddy/\" target=\"_blank\">announced</a> this week that GoDaddy has acquired the company. Founders Dan Norris and Alex McClafferty bootstrapped WP Curve in 2013 and have processed 105,000+ jobs through its pipeline.</p>\n<p>&#8220;WP Curve complements GoDaddy’s expanding WordPress offering including Managed WordPress and the recent ManageWP addition,&#8221; the company said in the announcement.</p>\n<p>Existing customers will be on-boarded to GoDaddy accounts with their current subscriptions. After the transition, the newly acquired WP Curve team will assist in scaling the services to support GoDaddy&#8217;s WordPress customers. Norris plans to exit the company and McClafferty will lead the team at GoDaddy.</p>\n<h3>GoDaddy&#8217;s Plans for WP Curve</h3>\n<p>Gabe Mays, head of WordPress Products at GoDaddy, said the WP Curve acquisition is an important part of GoDaddy&#8217;s goal to become &#8220;a one-stop shop for WordPress professionals.&#8221; Roughly one third of all GoDaddy sites are running on WordPress, and half of all new sites are using the software. This is one of the reasons GoDaddy plans to <a href=\"https://wptavern.com/wordpress-passes-27-market-share-banks-on-customizer-for-continued-success\" target=\"_blank\">invest in improvements to WordPress&#8217; core customizer component</a>.</p>\n<p>&#8220;WP Curve will help us in two ways,&#8221; Mays said. &#8220;First we’re adding WP Curve’s WordPress experts to the company and we’ll leverage their expertise to improve the training and tools for the hundreds of GoDaddy Customer Care representatives that support our customers globally.</p>\n<p>&#8220;Second, we’ll directly offer WP Curve&#8217;s services to our customers,&#8221; Mays said. &#8220;This combination will be amazing for our customers and create a compelling one-stop shop for WordPress professionals and their clients.&#8221;</p>\n<p>Mays said WP Curve&#8217;s services &#8220;will continue to be offered as standalone services&#8221; but GoDaddy may consider adding them to its hosting plans sometime in the future.</p>\n<p>&#8220;Down the road it&#8217;s possible we&#8217;ll see aspects integrated into our Hosting plans to improve the customer experience, especially for nascent WordPress users,&#8221; Mays said.</p>\n<p>Mays would not comment on whether GoDaddy has more acquisitions in the pipeline, but the company is likely to require additional expertise if it aims to become a one-stop shop for WordPress professionals. GoDaddy is part of a more recent trend of hosting companies acquiring WordPress products and services, including its <a href=\"https://wptavern.com/godaddy-acquires-wordpress-site-management-service-managewp\" target=\"_blank\">ManageWP acquisition</a> and <a href=\"https://wptavern.com/flywheel-acquires-wordpress-local-development-tool-pressmatic\" target=\"_blank\">Flywheel&#8217;s purchase of Pressmatic</a>. The trend has sparked some recent discussion on Twitter regarding &#8220;hosting companies eating WordPress:&#8221;</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">If software is eating the world, then hosting companies are eating WordPress.</p>\n<p>&mdash; Cory Miller (@corymiller303) <a href=\"https://twitter.com/corymiller303/status/805891418866806784\">December 5, 2016</a></p></blockquote>\n<p></p>\n<p>Mays sees this notion as a positive development and an opportunity for hosts to become more deeply invested in WordPress core and the surrounding ecosystem.</p>\n<p>&#8220;We see it as win-win for hosts and the WordPress community, more investment in WordPress is better for everyone,&#8221; Mays said. &#8220;For example, this year we hired our first core contributor, contributed full translations to some of the most popular themes and plugins, built a number of themes and plugins and contributed them to the WordPress repo and more. As a WordPress community we need all the investment we can get to reach our 50% goal and beyond.&#8221;</p>\n<p>Just days after the WP Curve acquisition, GoDaddy <a href=\"https://aboutus.godaddy.net/newsroom/news-releases/news-releases-details/2016/GoDaddy-Acquires-Host-Europe-Group-Becomes-Market-Leader-In-Europe-For-Small-Business-Cloud-Services/default.aspx\" target=\"_blank\">announced</a> its acquisition of <a href=\"https://www.heg.com/\" target=\"_blank\">Host Europe Group</a> (HEG) for $1.8 billion. HEG is Europe&#8217;s largest privately-owned web services provider in Europe and the purchase delivers 1.7 million new customers to GoDaddy, expanding the company&#8217;s international reach.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 08 Dec 2016 20:49:26 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:39;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"WPTavern: The Value of Sponsoring a WordCamp from a Business’ Perspective\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=64315\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"https://wptavern.com/the-value-of-sponsoring-a-wordcamp-from-a-business-perspective\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:27974:\"<a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/12/tony-perez-sucuri.jpg?ssl=1\"><img class=\"wp-image-64317 size-thumbnail\" src=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/12/tony-perez-sucuri.jpg?resize=150%2C150&ssl=1\" alt=\"Tony Perez, CEO of Sucuri\" /></a>Tony Perez, CEO of Sucuri\n<p>This is a guest post written by Tony Perez, <a href=\"http://perezbox.com/about/\">co-founder and CEO</a> of <a href=\"https://sucuri.net\">Sucuri</a>. Sucuri is a website security platform that helps clean and protect websites. I would consider us a small mid-sized company. Our annual sponsorship budget is in the range of $300 &#8211; $400k per calendar year (CY).</p>\n<p>One of the industry events we’ve been actively participating in since our inception has been WordCamps. Unlike 2015, in 2016 I decided to be more pragmatic in the way we invest in WordCamps. This new approach stemmed from two basic questions &#8211; <b>What is the ROI of sponsoring a WordCamp and should a business sponsor a WordCamp?</b></p>\n<p>One qualifier I want to add before getting started is that tracking success at events is very difficult. Even with the number of tools and approaches in the market, many organizations struggle getting their hands around the actual ROI of any event sponsorship. This means that many of the points in this post are not unique to the WordPress ecosystem, but the uniqueness and openness of the community makes it worth discussing.</p>\n<hr />\n<h1>The Reality of WordCamps and Sponsors</h1>\n<p>It’s been many years since I helped co-organize a WordCamp (<a href=\"https://2011.sandiego.wordcamp.org/\">San Diego back in 2011</a>), and there is no denying that a lot has changed in the way they are put together. The one thing that hasn’t changed however, is the struggle organizers face when it comes to fundraising. Over the years we’ve seen a number of awesome initiatives by the <a href=\"http://wordpressfoundation.org/\">WordPress Foundation</a> to help assist in the process.</p>\n<p>At <a href=\"https://2016.us.wordcamp.org/\">WordCamp US 2016</a>, <a href=\"https://wptavern.com/state-of-the-word-2016-mullenweg-pushes-calypso-as-future-of-wordpress-interface-proposes-major-changes-to-release-cycle\">the State of Word reported </a>that in 2016 alone there were:</p>\n<ul>\n<li>116 WordCamps around the world</li>\n<li>36,000 attendees</li>\n<li>2,056 speakers</li>\n<li>1,036 sponsors</li>\n<li>750 organizers</li>\n</ul>\n<p>What makes it even more impressive is that these are events put on by volunteers. Matt Mullenweg also shared that these WordCamps are made possible by the generosity of the various sponsors which cover 85 &#8211; 95% of the costs associated with such events.</p>\n<p>It’s because of these sponsors that the costs are kept so low for attendees; including the annual event (WCUS) which came in at a cost greater than $500 per person but sold for ~$20 / day (Total of $40 / person). This is truly a herculean feat, and I commend them on their success to date.</p>\n<h1>The Sponsor Canoe Is Leaking</h1>\n<a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/12/Canoes.png?ssl=1\"><img class=\"size-full wp-image-64321\" src=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/12/Canoes.png?resize=705%2C210&ssl=1\" alt=\"Canoes\" /></a>photo credit: dolbinator1000 <a href=\"http://www.flickr.com/photos/126654539@N08/25305151246\">Boyhood</a> &#8211; <a href=\"https://creativecommons.org/licenses/by/2.0/\">(license)</a>\n<p>With this in mind, I think it’s fair to say that at the rate things are going we might find ourselves with a problem of scale. While there have been 1k + sponsors in 2016, I would wager that a majority of the money is likely coming from a smaller subset of that group.</p>\n<p>Taking this into consideration, unless you’re Automattic, I can’t help but imagine that as a business the ROI question continues to come up as it does for me. This is further compounded by the dramatic increase in the <strong>a)</strong> request for sponsorships (# of camps) and <strong>b)</strong> the economics of the sponsorship itself (the $$ amount).</p>\n<p>This makes me think that it’s only a matter of time when the source of funds will be exhausted. Organizations have fiduciary responsibilities to their companies to spend their cash flow wisely, especially in today’s turbulent economic times.</p>\n<p>The impacts of this, as highlighted above, are going to be felt (if not already) by those volunteers trying to put on these great WordCamps. This will become exceptionally difficult for new camps, especially those in remote cities and countries.</p>\n<h1>Why Do Businesses Sponsor WordCamps?</h1>\n<a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2015/09/QuestionmarkSmaller.png?ssl=1\"><img class=\"size-full wp-image-48305\" src=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2015/09/QuestionmarkSmaller.png?resize=650%2C200&ssl=1\" alt=\"Smaller Question mark featured image\" /></a>photo credit: <a href=\"https://www.flickr.com/photos/matthewmcvickar/4380126801/\">Matthew McVickar</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-nc-sa/2.0/\">cc</a>\n<p>There is one common phrase every business that has invested in WordCamps has come to terms with &#8211; <b>sponsorships are done in-kind; expect nothing</b>.<i> I’m not clear how this guidance came to be, whether it was explicitly outlined by the Foundation or guidance that came to be over time. What I do know is that a good number of sponsors are familiar with it. </i></p>\n<p>Whether intended or not, allow me to be the first to publicly admit that while we are familiar with the phrase, no one really subscribes to it. The dirty little secret is that every business has some form of an expected ROI. It’s not always financially based, but there is some expectation. Companies sponsor events because there is some vested interest unless we’re talking about a child’s gymnastics or softball team.</p>\n<p>ROI takes many different shapes. Allow me to share the ROI as I see it when I look across the spectrum of some of today’s top sponsors (know that these are all my opinions as a third-party observer):</p>\n<h3><b>GoDaddy </b></h3>\n<p>They sponsor because they need to. When they came into the space two to three years ago, after the changing of the guard they identified the potential in WordPress. They had an image problem; one that couldn’t be fixed remotely. It had to be fixed with boots on the ground.</p>\n<p>Building relationships. Sharing experiences. Engaging influencers (do not underestimate the power of influencers). Whatever you might think of the brand today is nothing compared to what it was a few years ago. WordCamps have been a critical piece of their strategy to make this work. Who doesn’t know <a href=\"https://ifyouwillit.com/about-mendel-kurland/\">Mendel Kurland</a>?</p>\n<h3><b>SiteGround </b></h3>\n<p>When they started to make their big push into the market, they were at every camp giving away free accounts. For them, it wasn’t about the short-term gain as much as the long-term gain. They had everything going against them. They were from Bulgaria working to service the biggest economic market, the US. They were trying to penetrate what many would argue was an already saturated market.</p>\n<p>I remember when they first appeared. No one knew them, and yet through their guerrilla marketing tactics, brand ambassadorship, stellar performance with customers, and word-of-mouth referrals, they are a powerhouse in the WP hosting space.</p>\n<h3><b>WP Engine</b></h3>\n<p>While they exploded through a number of initiatives, I believe that WordCamps and their strategy to engage with the community is what propelled them ahead of their competitors. Their focus wasn’t revenue generation early on. I recall their free accounts campaign. I think it ran for close to two years.</p>\n<p>What better combination than to have a freemium-like model where all you have to do is focus on user adoption (oversimplification of course). Your product and support are spot on, you just need more people touching it, more people telling their friends about it. They grew organically and these events made that possible.</p>\n<h3><b>Automattic</b></h3>\n<p>Honestly, they have no choice but to sponsor. They are the project sponsor by design. They are in many ways tied to the success and continued growth of the platform. They too have their free services that require adoption and user growth, things like Jetpack, Akismet, WooCommerce, and so many others.</p>\n<p>Without growth, they are dead solutions. They have to show support for a product that they’ve gone all in on. If they don’t sponsor, why would anyone else? Their fates are intertwined.</p>\n<p>And the observations go on. Granted, these are obvious gross oversimplifications, but I share them to highlight what ROI can look like. I also share them to show you what success looks like, and what the DNA of these organizations look like. Most of the scenarios above are built on the idea of “free” or “free-ish” services, with the exception being GoDaddy whose prices are so low you might as well consider them a freemium-like model.</p>\n<h1>Measuring the ROI of Events</h1>\n<p>What happens if you’re a premium service though? In this scenario, your ROI is no longer about adoption or user growth. Instead you’re now focused on growth in the form of revenue and sales. User adoption will never be as great as the freemium model.</p>\n<p>As organizations, we’ve invested a lot of money. There has to be something we’re getting out of this. Only in the WordCamp community have I seen this idea that people will donate not only time, but money, under the assumption that there will be nothing at the end of the tunnel.</p>\n<p>I wanted to better understand this myself, and what better place to look for ROI than our own data here at Sucuri.</p>\n<p>The data below highlights the period between December 2015 &#8211; June 2016. I encourage other businesses to share their own data to add to the conversation. When speaking to ROI, I looked for measurable attributes first:</p>\n<ul>\n<li>How many marketing leads were captured?</li>\n<li>How many sales leads were captured?</li>\n<li>How many of those leads converted to sales?</li>\n<li>What kind of exposure did we get via social?</li>\n<li>What kind of exposure did we get via backlinks?</li>\n</ul>\n<p>Perhaps the biggest immeasurable metric being:</p>\n<ul>\n<li>What kind of brand awareness are you really getting?</li>\n</ul>\n<p>In the table below, <b>sponsorship</b> is exactly what you’d think, while <b>financial investment</b> implies ancillary costs of getting people there, lodging and eating. It does not include labor, collateral, shipping and other items.</p>\n<a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/12/SucurisWordCampsInvestments.png?ssl=1\"><img class=\"size-full wp-image-64325\" src=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/12/SucurisWordCampsInvestments.png?resize=996%2C265&ssl=1\" alt=\"Sucuri WordCamp Investments Dec. 2015 - June 2016\" /></a>Sucuri&#8217;s WordCamp Investments Dec. 2015 &#8211; June 2016\n<p>This chart shows the ROI we got in terms of money (did we close deals?) As a for-profit business one of the many attributes we look at are the total net-new customers we can generate from any investment, including events.</p>\n<a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/12/SucuriCPLCACInvestment.png?ssl=1\"><img class=\"wp-image-64327 size-full\" src=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/12/SucuriCPLCACInvestment.png?resize=887%2C259&ssl=1\" alt=\"Sucuri Investment CPL/CAC Analysis\" /></a>Sucuri Investment CPL/CAC Analysis\n<p>To date, from all the events including WordCamp US (2015), we were able to track a total of 13 deals that closed from a direct engagement at the event. Putting the Customer Acquisition Cost (CAC) in the neighborhood of $12.4k per closed lead.</p>\n<p>This means that my lifetime value (LTV), if they purchased a basic plan at $199.99 would have to be 45 years. If they purchased our $499.99 plan, we&#8217;d be looking at a 18 year LTV.</p>\n<a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/12/SucuriInvestmentMeasurableROI.png?ssl=1\"><img class=\"size-full wp-image-64328\" src=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/12/SucuriInvestmentMeasurableROI.png?resize=1006%2C165&ssl=1\" alt=\"Sucuri Investment Measurable ROI\" /></a>Sucuri Investment Measurable ROI\n<p>Focusing on exposure, it is one of the many things you get from sponsoring an event. You get linkbacks from the event, shout outs on the pages, posts highlighting your sponsorship. What does that really amount to? Can it be measured? The easiest way to answer these questions was to look at the main site links and social engagements.</p>\n<a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/12/SucuriWebSocialImpact.png?ssl=1\"><img class=\"size-full wp-image-64329\" src=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/12/SucuriWebSocialImpact.png?resize=577%2C304&ssl=1\" alt=\"Sucuri Web / Social Sponsorship Impact\" /></a>Sucuri Web / Social Sponsorship Impact\n<p>We generated 190 sessions total, the most coming from WordCamp US (at the time of the event, not leading up to it, or after). We generate over 500k sessions a month across all our platforms. This makes 190 total sessions over a six month period negligible.</p>\n<p>In my review, we looked at direct traffic from referrals and traced down the social <b>&#8220;thank you&#8221;</b> and <b>&#8220;promotions&#8221;</b> each event provided. It&#8217;s fair to note, that the lack of success in the measurable values above could be very closely be related to our ineffectiveness as an organization as well. We could just be really bad at working events; it’s an art in and of itself.</p>\n<p>I intentionally did not include marketing leads. For me, my focus is looking at what actually converts so when we go to events, we place more emphasis on qualified sales leads (opportunities) than marketing leads; I am not very big on getting into the card collection and SPAM business.</p>\n<p><b>What does this all mean?</b></p>\n<p>Well, if I was a rational person this would mean that as a premium service provider, investing in WordCamps doesn’t make sense. Trust me, I love the community. We are involved in many ways, but this is really too difficult to digest and justify. I wonder what happens when more companies, even the ones that I shared above, start doing the same mathematics.</p>\n<h1>The WordCamp Sponsorship Conundrum</h1>\n<p>The WordPress platform promotes the idea of Free and targets a very curious niche of people &#8211; self-service/Do It Yourself (DIY) types. By this self-proclaimed profile, they are not buyers of premium services; they are the ones that will invest sweat equity to build or find an alternative to their problem &#8211; <b>it just has to be free. </b></p>\n<p>This ideology is fine, but it also means that it frankly may not be the right market for most premium businesses. I would be remiss however, if I did not highlight the fact that a number of the sponsors for WCUS 2016 were premium service providers. The only challenge I would make to this claim is that just because they are sponsoring, doesn’t mean they are getting a return.</p>\n<p>I’d also challenge it and say some of them have a need to sponsor for some of the same reasons described above. Just because a premium service sponsors, it doesn’t mean their goal is defined purely around selling, in many instances it’s built around brand awareness and ambassadorship &#8211; especially unknown brands, or those with bad reputations. GoDaddy is a perfect example of this.</p>\n<p>Does this mean that there is no hope? No, I don’t think so. I just think we have to ask ourselves some key questions, both as organizations and a community. To assist in the conversation, I’ve highlighted a few areas that I find challenging as a business and encourage others to introduce their own. If nothing else, this can help both the Foundation and organizers alike better work with sponsors.</p>\n<h2>The Audience Quality Factor</h2>\n<p>When we turn our attention to WordCamps, events designed to promote and bring together these ideals, you realize that the problem with WordCamps for businesses is the audience.</p>\n<p>I&#8217;m by no way saying that their current design is bad for what WordCamps were designed for. On the contrary, I&#8217;d say they&#8217;ve done an exceptional job sticking to their predefined audience, at least in terms of cost bracket. They don’t, however, do a good job of differentiating between the various personas in attendance. They’re all rolled up into one big bucket. This creates a severe imbalance between the economic investment and audience potential.</p>\n<p>This imbalance I think has to do with the quality of the audience. This is not meant to imply that the audience is not good in their own right, but from a company perspective not so much (i.e., as a potential customer). In a world where everything is expected to be free, and quickly commoditized, how do you bridge that divide?</p>\n<p>This also has residual effects as well into the quality that can be expected at the event, in terms of organization, presentation and speakers. There are so many different ways this can go, does it mean WordCamp Pro like events? I’m not sure, but what I do know is that in it’s current incarnation something has to give.</p>\n<p>Granted, this does not apply to everyone. I know a number of theme shops that bring and meet their customers at these events. Where closing one deal cannot only cover their costs, but set them up nicely for a couple of months.  My points here are more tailored at product / premium shops that are operating at a very different scale and configuration.</p>\n<h2>Increasing Number of Events Globally</h2>\n<p><a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2013/05/WPWorldLogo.jpg?ssl=1\"><img class=\"alignright size-full wp-image-6948\" src=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2013/05/WPWorldLogo.jpg?resize=200%2C160&ssl=1\" alt=\"WordPress World\" /></a>The sheer volume of camps and sponsorships presents a very big problem, not just for the Foundation but for businesses as well. Which ones do you invest in? Which will offer the most return?</p>\n<p>I assure you, these are the conversations that are occurring. There are so many, and it’s impossible to invest in them all (at least in a meaningful way). This will continue to put undue pressures on all the organizing teams looking to raise funds. I think you can see an example of this with this years WCUS 2016 sponsorships, a very different (stark) representation of today’s reality when it comes to sponsorships.</p>\n<p>Yes, I&#8217;m very familiar with the new Global Sponsorship opportunities the Foundation has put together. They&#8217;re divided by geographic region, and don&#8217;t include the main geographic events like WordCamp US and WordCamp Europe. The prices are below:</p>\n<a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/12/GlobalSponsorshipOpportunities.png?ssl=1\"><img class=\"size-full wp-image-64326\" src=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/12/GlobalSponsorshipOpportunities.png?resize=730%2C143&ssl=1\" alt=\"Global Sponsorship Prices\" /></a>Global Sponsorship Prices\n<p>It’s definitely a great idea, but providing a large sum of cash that gets distributed across events that you may or may not attend isn’t something I’m particularly fond of. I worry about the longevity of this program, and while I know there are always new sponsors, what will the churn look like in the program. Only time will tell.</p>\n<h2>Impacts of a Corporation Type</h2>\n<p>For those unfamiliar, the entity responsible for facilitating the growth and management of WordCamps around the world is now known as the <a href=\"https://make.wordpress.org/community/2016/03/02/transitioning-to-wordpress-community-support/\">“WordPress Community Support (WPCS) Public Benefit Corporation (PBC)”</a>. This new entity is a subsidiary of the WordPress Foundation, which is still a non-profit, and established in 2016 (Yes, Matt said it’d take effect in 2017 but I’m pretty sure that was in error).</p>\n<blockquote><p>After March 31, sponsorship payments sent to WordPress Foundation accounts will be returned to sender. Please send <a href=\"https://make.wordpress.org/community/handbook/wordcamp-organizer-handbook/first-steps/budget-and-finances/running-the-money-through-wpcs/#sponsorship-revenue\">revised payment instructions</a> to any sponsors who have not yet paid.</p></blockquote>\n<p>This new entity is what is known as a benefit corporation, and should NOT be confused with a b-corp. Although it is used in many instances interchangeably, there are a number of differentiating factors, the biggest being that to obtain a b-corp classification an entity must be certified.</p>\n<blockquote><p>B Corps are for-profit companies certified by the nonprofit B Lab to meet rigorous standards of social and environmental performance, accountability, and transparency.</p></blockquote>\n<p>Establishing a PBC to handle the WordCamps I firmly believe was done with the best of intentions for the community, but it does present a few challenges for private businesses. A PBC is still a private for-profit company. The biggest difference, however, is that unlike other corporation types (e.g., C, S, etc..) a PBC allows an organization to be a charter (or mission focused) in addition to more traditional goals of generating profits for its shareholders.</p>\n<p>This change is a bit more significant than might be implied when reading through <a href=\"https://make.wordpress.org/community/2016/03/02/transitioning-to-wordpress-community-support/\">the announcement</a>. One of the driving forces for the change was to make the sponsorship process easier for both the organizers and sponsors alike:</p>\n<blockquote><p>One of the main advantages to the change from the WordPress Foundation (a non-profit) to the WPCS (a public benefit corporation) is that the rules around sponsoring official WordPress events are much simpler.</p>\n<p>The people involved in overseeing the program have updated sponsor rules accordingly, to eliminate the barriers to value-adding stuff like direct links, discounts, and calls to action, while keeping the ones that helped us form such a trustworthy, community-focused sponsor program, like the rule about not using superlatives or unprovable claims.</p></blockquote>\n<p>As a prior WordCamp organizer, there is perhaps no greater challenge in my mind than asking people for money. While my experience was back in 2011, I can only imagine that the struggles are still the same and one of the things leveraged when pitching to companies are the benefits of a non-profit. The non-profit classification was not just about securing donations like venues (which is very important) but it’s critical for some in securing the dollars they require.</p>\n<p>For a company, it also makes it harder to justify the costs. As the dollar investment continues to increase, the one thing that could always be counted on was the non-profit status. By changing it to a private organization (on paper) it’s donating money to another company (regardless of what the mission may or may not be). This might not be a big deal for some, but when we start talking significant investments, it becomes a serious problem.</p>\n<h1>Incentivizing Businesses</h1>\n<p>When you read through the <a href=\"https://make.wordpress.org/community/handbook/wordcamp-organizer/planning-details/fundraising/wordcamp-sponsorship/#wordcamp-sponsorship-rules-for-2016\">Sponsorship rules for 2016</a> the changes are not incentivizing enough for a business. The biggest change being the ability to print comparisons or introduce pricing on collateral, both of which are insignificant as you can account for most of your physical collateral to end up in the trash and difficult to track.</p>\n<p>I believe there will be, or are changes in the works, to include pricing on virtual print as well which will definitely be a positive move, but I defer to the ROI measurements above as well.</p>\n<p>While the idea of incentivizing a business might be repulsive, it’s a necessity. As a good friend of mine mentioned, it’s about exposure for businesses. If we’re investing significant dollars and being such pivotal players in the success of these events, then we’re going to ask for as much exposure as possible.</p>\n<p>We’re also going to push the limits of our imaginations and require some flexibility, in return I think most companies would willingly be open to negotiation and flexibility. If ROI is going to be based on exposure and brand awareness, we need to be able to capitalize on that.</p>\n<p>What might be interesting here is to perhaps do a survey of businesses, those that have been supporting the WordCamp communities for years, and take a poll. Maybe present some options and make them part of the process. Even if it’s a fixed list, maybe ask for a wishlist of things; things that can be discussed and openly taken into consideration.</p>\n<p>Like I tell my teams &#8211;<b>most reasonable people don’t need to always win, they just want to be heard and be part of the process.</b> This applies to companies as well. When it comes down to it, it’s but a few people at each organization that will be your evangelists.</p>\n<h1>WordCamp Sponsorship Can Work</h1>\n<p>I am not saying that sponsoring WordCamps is not valuable. I’m also not saying that it’s a lost cause working with WordCamps.  I am saying that it’s important to have a dialog if longevity is what we’re after in the community,  sponsorships are the bloodline that keep these events going.</p>\n<p>There is little that can be done about the growth of events or the new subsidiary (and I don’t think either is bad). They are today’s realities and as organizations we’ll have to work through them independently.</p>\n<p>The two areas I think can be improved on is the audience and how businesses are incentivized.</p>\n<ul>\n<li>I’m not particularly hopeful of the audience, that’s a problem the community will need to solve and not necessarily something the Foundation should concern themselves with. If I were the Foundation, I would be doing exactly what they are doing &#8211;<b> keep the price as low as possible to make it reachable to everyone (need a low barrier to entry). </b>We’ve already seen a few events attempt this, and the best example in my opinion so far has been <a href=\"https://wooconf.com/\">WooConf</a> and <a href=\"https://wpcampus.org/\">WPCampus</a>.</li>\n</ul>\n<ul>\n<li>The one I’m more hopeful of is how businesses are incentivized. If we can agree that at a minimum all organizations are looking for exposure, then that should be the easiest place to start. A few examples might include: speaking guarantees, more prominent branding, access to some form of audience information. Yes, some of these are highly controversial, but I have faith that together we can make something work that is in line with the spirit of these events. I would also encourage other camps to look at <a href=\"https://2017.miami.wordcamp.org/\">WordCamp Miami</a>; beyond  having a Learn JavaScript Deeply track, they do an exceptional job with the way they engage with their sponsors.</li>\n</ul>\n<p>I share this post as a way to provide a perspective that I hope is unique and valuable. If it starts a discussion, and opens a better dialog between businesses, WordCamp organizers and the Foundation then I will consider it a success. Sponsors are a critical piece to the continued success and growth of these community events, and I’d like to ensure that continues.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 08 Dec 2016 04:36:11 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:40;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"BuddyPress: BuddyPress 2.7.3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://buddypress.org/?p=261855\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"https://buddypress.org/2016/12/buddypress-2-7-3/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:756:\"<p>BuddyPress 2.7.3 is now available. This is a maintenance release and a recommended upgrade for all BuddyPress installations.</p>\n<p>BP 2.7.3 fixes bugs in several components. For more information, see the <a href=\"https://buddypress.trac.wordpress.org/query?group=status&milestone=2.7.3\">2.7.3 milestone</a> on <a>BuddyPress Trac</a>.</p>\n<p>Update to BuddyPress 2.7.3 today in your WordPress Dashboard, or by <a href=\"https://wordpress.org/plugins/buddypress/\">downloading from the wordpress.org plugin repository</a>.</p>\n<p>Questions or comments? Check out the <a href=\"https://codex.buddypress.org/releases/version-2-7-3/\">2.7.3 changelog</a>, or stop by our <a href=\"https://buddypress.org/support/\">support forums</a> or  <a>Trac</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 07 Dec 2016 23:15:56 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"@mercime\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:41;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"WPTavern: WordPress 4.7 is the First Release to be 100% Translated into Urdu\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=64040\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"https://wptavern.com/wordpress-4-7-is-the-first-release-to-be-100-translated-into-urdu\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5620:\"<a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/11/lahore-pakistan.jpg?ssl=1\"><img src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/11/lahore-pakistan.jpg?resize=1024%2C589&ssl=1\" alt=\"\" class=\"size-full wp-image-64311\" /></a>photo credit: WasifMalik <a href=\"http://www.flickr.com/photos/47644350@N04/23458524585\">Wazir Khan Masjid Mosque Shahi Royal Hammaam Bathhouse Lahore Pakistan Oct 2015  031</a> &#8211; <a href=\"https://creativecommons.org/licenses/by/2.0/\">(license)</a>\n<p><a href=\"https://wptavern.com/wordpress-4-7-introduces-twenty-seventeen-default-theme-and-wp-rest-api-content-endpoints\" target=\"_blank\">WordPress 4.7 was released yesterday</a> with translations for 52 languages, thanks to the volunteer efforts of its vibrant community of translators. For the first time, WordPress is 100% translated into Urdu, the national language of Pakistan. Urdu is spoken by 100 million people in several different areas of the world, including India, Bangladesh, Nepal, and the Middle East.</p>\n<p>As part of the effort to bring the Urdu translation to 100%, WordPress developer Ahmad Awais <a href=\"https://ahmadawais.com/urdu-wordpress/\" target=\"_blank\">organized a small meetup in Lahore, Pakistan</a> during the <a href=\"https://wptavern.com/2nd-global-wordpress-translation-day-brings-780-translators-together-across-133-locales\" target=\"_blank\">2nd WP Translation Day</a> event. More than 60 attendees joined online and offline over the span of two days with many participating in the <a href=\"http://WP-Pakistan.Slack.com\" target=\"_blank\">WP-Pakistan Slack</a> team in the #translators channel.</p>\n<p>Having WordPress available in Urdu is a major milestone for the Pakistani tech community. It makes it possible for government websites to adopt the software.</p>\n<p>&#8220;The government websites are required to be accessible,&#8221; Awais said. &#8220;While we are not there yet, there are efforts underway to make every government website available in both English and Urdu.&#8221;</p>\n<p>Awais cited the <a href=\"https://www.nadra.gov.pk/\" target=\"_blank\">National Database and Registration Authority</a> (NADRA) website as one example that has recently started using WordPress for its online portal. NADRA issues identity cards with CNIC numbers in Pakistan, similar to social security numbers in the US.</p>\n<p><a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/11/nadra-website.png?ssl=1\"><img src=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/11/nadra-website.png?resize=1025%2C720&ssl=1\" alt=\"\" class=\"aligncenter size-full wp-image-64303\" /></a></p>\n<p>&#8220;The NADRA site is far from perfect but is much better than other government sites,&#8221; Aawais said. &#8220;People have already started to notice that. There&#8217;s a pretty large developer community in Pakistan that&#8217;s connected to WordPress in one way or another, but on the consumer end &#8211; not so much.&#8221;</p>\n<p>Awais said many Pakistani media sites are powered by WordPress but adoption is slower when it comes to e-commerce. WordPress penetration in the enterprise sector is nearly non-existent.</p>\n<p>&#8220;I think the 100% Urdu variant of WordPress will definitely help in the expansion for the local consumer-base,&#8221; Awais said. &#8220;Web developers will find it easier to pitch WordPress as the go-to CMS for government, local, and higher education web properties as compared to other proprietary, closed-source Urdu CMS software. That alone can have a huge impact as far as the growth of the local WordPress community is concerned.&#8221;</p>\n<p>The concept of contributing back to open source software is still relatively new in Pakistan but Awais and his fellow translators and developers are working to change the general perception in their tech culture.</p>\n<p>&#8220;I would like to request Foundation to pay more attention to regions like ours, where software developers, computer science students, and entrepreneurs seldom understand the concept of open source software,&#8221; Awais said. &#8220;The concept of giving back and making it work to pay the bills is lost on simple and misunderstood questions of &#8216;Can people make money via Open Source?&#8217; and &#8216;What do you get by giving back and helping out for free?&#8217;</p>\n<p>&#8220;Believe me, these are tough questions to be answered when there are no huge WordPress supported companies picking up the tabs for those who are trying to give back,&#8221; Awais said. &#8220;Support for open source is a rare commodity here. I hope that changes in the next five years or so.&#8221;</p>\n<p>During the <a href=\"https://wptavern.com/state-of-the-word-2016-mullenweg-pushes-calypso-as-future-of-wordpress-interface-proposes-major-changes-to-release-cycle\" target=\"_blank\">2016 State of the Word</a>, Matt Mullenweg said one of <a href=\"https://twitter.com/WordCampUS/status/805158678353608704\" target=\"_blank\">the Foundation&#8217;s new focuses</a> will be running educational workshops in developing nations. When asked about how this initiative will work during the Q&amp;A session, Mullenweg said they are still figuring it out but envision an open source curriculum with locally run classes and support.</p>\n<p>More than 100 translators participated in bringing the Urdu translation to 100% for WordPress. With the software now accessible to 100 million Urdu speakers, the region seems like a good candidate for an educational investment to bring more developers up to speed with using WordPress for commerce and government sites.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 07 Dec 2016 20:56:48 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:42;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"HeroPress: Full Circle: Life Lessons of a Perennial Entrepreneur\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://heropress.com/?post_type=heropress-essays&p=1517\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"https://heropress.com/essays/full-circle-life-lessons-perennial-entrepreneur/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:10454:\"<img width=\"960\" height=\"480\" src=\"http://20094-presscdn.pagely.netdna-cdn.com/wp-content/uploads/2016/12/120716-1024x512.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Pull Quote: Take the time to learn the fundamentals of HTML, CSS, JS and PHP. You\'ll be glad you did.\" /><p>I didn’t go to college until I was in my 40’s. When I graduated high school I went to work for a family business.</p>\n<p>There has been one common thread throughout my adult career, my love for technology.</p>\n<p>I was 24 when I bought my first computer, it was PC running MS-DOS.</p>\n<p>Five years later, the company I was working for bought a computer program to manage their rental properties. I was responsible for using it and data entry. The program was written by a local software developer. He became a mentor and when problems arose with the code, he walked me through on the phone how to edit and compile the source code. (Yes, he left a copy of the source code on the computer &#8211; this was way before remote support was possible.) It was dBase II. Fast forward a few years later and he hired me as a part-time contractor to help him customize the codebase for his clients. It seemed I had a knack for writing code and troubleshooting bugs.</p>\n<p>Eventually, I would go on to purchase the source code from him and launch my own property management software company. I ran it for eight years, while I rewrote the entire codebase. My business grew. I learned a lot about sales, running a business and managing employees. Most importantly, I learned how to listen to clients and by doing so, I was able to create the products they needed to run their businesses.</p>\n<p>Then, Windows came onto the scene. My software was not Windows compatible. It was running on FoxPro, a Dbase III competitor for MS-DOS. My business plateaued and I was faced with another rewrite of the codebase to stay competitive. To top it off, I’d lost my only support person at the same time. These are the challenges most small business owners face at some point. I was experiencing burnout and needed a change. Long story short, I eventually sold the software line to a competitor who was looking to expand their user base and incorporates some features that were in demand that my product had. It was win-win for both of us and to this day &#8211; I&#8217;m still happy about that transaction.</p>\n<p>I went on to work at a boutique consulting services firm in Houston, Texas as an Account Manager to large Fortune 500 clients, mostly in the energy sector. It was an amazing experience and I learned a lot about working in the enterprise space. This was very different from working with the small property management companies I had previously serviced. It was a great four years. The last year boomed as many clients scrambled to complete their <a href=\"https://en.wikipedia.org/wiki/Year_2000_problem\">Y2K upgrades</a>.</p>\n<p>In the spring of 2000, everything changed. The company had been acquired, and the dot-com bubble had burst. All the Y2K work was done and the world did not end. I decided to take some time off.</p>\n<p>In the fall of 2000, I enrolled at a local community college. I spent the next two years and half years completing my core curriculum and then transferred to Texas A&amp;M in 2003 to complete a Bachelor of Science degree in Horticulture.</p>\n<p><strong>Why Horticulture?</strong> I’ve always loved gardening and jumped at the opportunity to learn everything I could about it.</p>\n<p><strong>Life Lesson:</strong> In hindsight &#8211; I wish I would have completed a degree in Computer Science. It was a bit of my own arrogance, that since I had run a software company and worked at a consulting firm, I knew all I needed to know. Truth was, I didn’t and would have benefited greatly from that experience.</p>\n<h3>Trying to make a hobby into a business.</h3>\n<p>In 2003, I decided to open an online store to sell home and garden gifts. I built a website using the Yahoo Store platform, and for the next 5 years watched it grow.</p>\n<p>My first introduction to WordPress came when I wanted to start a blog for the store. I like the idea of a self-hosted solution and loved getting back into programming.</p>\n<p>I went from running the business from my home to a small warehouse. It was 2007 and the housing market was booming. I jumped at the opportunity to lease a much larger warehouse with a retail storefront.</p>\n<p>There were important life lessons in it. One that made a strong impression on me was best described by the character Justin Matisse in the movie Hope Floats:</p>\n<blockquote><p>&#8220;You&#8217;re talkin&#8217; &#8217;bout the American Dream. You find something that you love, and then you twist it, and you torture it, try and find a way to make money at it. You spend a lifetime doing that. At the end, you can&#8217;t find a trace of what you started out lovin&#8217;. &#8220;</p></blockquote>\n<p>That’s how I felt sometimes when running my store. What I loved about the home and garden space and trying to make money at it were sometimes at odds with each other. I loved designing the website, adding functionality and mastering the art of improving the SEO of the site.</p>\n<p>I was about to learn a very painful and valuable lesson. I was financing the growth with debt. I got caught up in the growth curve and was sure that things would just keep getting better, allowing me to pay down the debt. Indeed servicing the debt was not a problem, as sales continued to grow.</p>\n<p>Then came 2008 and the Great Recession. For the next three years, I watched sales decline, my credit lines pulled and my business contract. That made servicing the debt, really hard. I was stuck in a lease that I could not afford. Many of the vendors I bought products from went out of business. Everyone was hurting. <strong>I was not financially prepared for it.</strong></p>\n<p>In the end, a chain of events led to a huge financial mess &#8211; one that to this day, I am still recovering from. In 2011, I liquidated the inventory, sold my online store to a third-party and moved on.</p>\n<h3>Transitioning to WordPress</h3>\n<p>I wasn’t sure what I wanted to do at that point. I was depressed and dealing with the financial fallout of losing my business.</p>\n<p>I wrote content for a garden center and slowly began working on websites for others. I chose to use the Genesis Framework and began customizing their themes for clients. I liked it because it leveraged the power of hooks and filters in a way that made sense to me &#8211; and the Genesis community is amazing.</p>\n<p>I worked in real estate for a while to help pay the bills, but it just wasn’t right for me.</p>\n<p>During this transition period, I used the time to improve my web development skills. I began working with WordPress every day, learning everything I could. I took online courses in HTML, CSS and PHP.</p>\n<p>Today, I’m running my own business again, building websites and helping clients promote their digital brand. I learned a lot about SEO running my eCommerce business, how to market products, write copy and promote my brand. Now I’m helping clients do that.</p>\n<p>With decades of business experience along with some hard life lessons, here’s what I’ve learned so far:</p>\n<ol>\n<li>Don’t assume things will continue in the same direction. Business is cyclical, so like a squirrel &#8211; stash away some nuts for the winter.</li>\n<li>Stay out of debt.</li>\n<li>Know when to hold &#8217;em and when to fold &#8217;em. Sometimes hindsight helps make this clearer, but trust your gut and follow your instincts.</li>\n<li>Be helpful to others. Take time to share what you’ve learned, make friends and enjoy the ride.</li>\n<li>Learn from every engagement, and take steps to improve how you communicate.</li>\n<li>Be a Life-Long Learner. Dedicate time to experiment, think and try new things.</li>\n</ol>\n<p>Finally, if you’re considering a career in web design and development in WordPress, take the time to learn the fundamentals of HTML, CSS, JS and PHP. You’ll be glad you did.</p>\n<div class=\"rtsocial-container rtsocial-container-align-right rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: Full Circle: Life Lessons of a Perennial Entrepreneur\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=Full%20Circle%3A%20Life%20Lessons%20of%20a%20Perennial%20Entrepreneur&via=heropress&url=https%3A%2F%2Fheropress.com%2Fessays%2Ffull-circle-life-lessons-perennial-entrepreneur%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: Full Circle: Life Lessons of a Perennial Entrepreneur\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=https%3A%2F%2Fheropress.com%2Fessays%2Ffull-circle-life-lessons-perennial-entrepreneur%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=https%3A%2F%2Fheropress.com%2Fessays%2Ffull-circle-life-lessons-perennial-entrepreneur%2F&title=Full+Circle%3A+Life+Lessons+of+a+Perennial+Entrepreneur\" rel=\"nofollow\" target=\"_blank\" title=\"Share: Full Circle: Life Lessons of a Perennial Entrepreneur\"></a></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=https://heropress.com/essays/full-circle-life-lessons-perennial-entrepreneur/&media=https://heropress.com/wp-content/uploads/2016/12/120716-150x150.jpg&description=Full Circle: Life Lessons of a Perennial Entrepreneur\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: Full Circle: Life Lessons of a Perennial Entrepreneur\"></a></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"https://heropress.com/essays/full-circle-life-lessons-perennial-entrepreneur/\" title=\"Full Circle: Life Lessons of a Perennial Entrepreneur\"></a></div><p>The post <a rel=\"nofollow\" href=\"https://heropress.com/essays/full-circle-life-lessons-perennial-entrepreneur/\">Full Circle: Life Lessons of a Perennial Entrepreneur</a> appeared first on <a rel=\"nofollow\" href=\"https://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 07 Dec 2016 12:30:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:19:\"Jackie D&#8217;Elia\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:43;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"WPTavern: Pantheon’s $100K WordCamp US Sponsorship Revoked the Night Before the Event\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=64248\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"https://wptavern.com/pantheons-100k-wordcamp-us-sponsorship-revoked-the-night-before-the-event\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:8493:\"<p>Nearly 2,000 people descended on Philadelphia, PA to attend WordCamp US last week. On the night before WordCamp US took place, <a href=\"https://pantheon.io/\">Pantheon&#8217;s</a> sponsorship was revoked and advertising materials, including the company&#8217;s booth, were hidden in a storage room inside the venue. The move generated a <a href=\"https://twitter.com/danielbachhuber/status/804721149900890112\">lot of controversy</a> on social media and at the event. It cost Pantheon $100K to sponsor WordCamp US, but the company received a refund.</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">Our booth disappeared but the team\'s still here! Look for us in yellow! <a href=\"https://twitter.com/hashtag/WCUS?src=hash\">#WCUS</a> <a href=\"https://t.co/lnF5aI36oy\">pic.twitter.com/lnF5aI36oy</a></p>\n<p>&mdash; Pantheon (@getpantheon) <a href=\"https://twitter.com/getpantheon/status/804715506674626560\">December 2, 2016</a></p></blockquote>\n<p></p>\n<p>Prior to WordCamp US Matt Stodolnic, Pantheon&#8217;s Vice President of Marketing, contacted the <a href=\"http://www.sheratonphiladelphiadowntown.com/\">Sheraton Downtown Philadelphia</a> and inquired about advertising opportunities. The Sheraton <a href=\"http://www.sheratonphiladelphiadowntown.com/philadelphia-meetings\">hosts a number of meetings</a> and has a couple of different advertising packages available. Stodolnic purchased advertising space on the hotel&#8217;s elevators. The advertising material was simple and didn&#8217;t make unprovable claims, such as the world&#8217;s best or fastest host. This is in line with the <a href=\"https://make.wordpress.org/community/handbook/wordcamp-organizer/planning-details/fundraising/wordcamp-sponsorship/#wordcamp-sponsorship-rules-for-2016\">sponsorship rules</a>.</p>\n<a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/12/PantheonElevatorAdvertising.png?ssl=1\"><img class=\"size-full wp-image-64262\" src=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/12/PantheonElevatorAdvertising.png?resize=629%2C806&ssl=1\" alt=\"Pantheon\'s Elevator Advertising\" /></a>Pantheon&#8217;s Elevator Advertising\n<p>On December 1st late at night, Stodolnic received an email from WCUS organizers requesting that the advertising material be removed. Stodolnic pushed back as the sponsorship agreement does not specifically prohibit advertising in the hotel. At one point during the exchange of emails, the WCUS organizing team threatened to take the banners down themselves. Stodolnic responded with anger as the purchase had already been made but he quickly apologized.</p>\n<p>The issue was eventually escalated to Matt Mullenweg, co-creator of the WordPress open source software project, who revoked the company&#8217;s sponsorship of the event for violating the code of conduct. Later that night, WCUS organizers deconstructed Pantheon&#8217;s booth and moved it to a storage room along with 600 T-shirts printed by the company.</p>\n<a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/12/PantheonsBoothBefore.png?ssl=1\"><img class=\"size-full wp-image-64259\" src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/12/PantheonsBoothBefore.png?resize=981%2C734&ssl=1\" alt=\"Pantheon\'s Booth at WCUS Before Being Taken Down\" /></a>Pantheon&#8217;s Booth at WCUS Before Being Taken Down\n<p>Day one of WordCamp US went off without a hitch but it was slightly overshadowed by the sudden removal of Pantheon. A few Pantheon employees published unfavorable messages on Twitter about the situation. Those tweets have since been deleted. At the conclusion of day two, Cami Kaos, one of the lead organizers of WordCamp US, published a post on the <a href=\"https://2016.us.wordcamp.org/\">event&#8217;s blog</a> highlighting what happened.</p>\n<a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/12/SponsorUpdatePost.png?ssl=1\"><img class=\"size-full wp-image-64261\" src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/12/SponsorUpdatePost.png?resize=1004%2C739&ssl=1\" alt=\"Archived Image of The Post Published on the WCUS Blog Explaining The Situation\" /></a>Archived Image of The Post Published on the WCUS Blog Explaining The Situation\n<p>The post doesn&#8217;t specifically name Pantheon and says the sponsor in question violated the event&#8217;s <a href=\"https://2016.us.wordcamp.org/code-of-conduct/\">code of conduct</a>. I spoke to a number of Pantheon employees who read the post and couldn&#8217;t identify the violation in question. Within hours of being published, the post was removed from the site without an explanation.</p>\n<h2>Cooler Heads Prevail</h2>\n<p>During day two of WCUS, Stodolnic and Pantheon Co-founder Josh Koenig, spoke to Mullenweg face-to-face in a closed-door meeting at the venue. What was said is unknown but when I asked Mullenweg what the result of the meeting was, he said, &#8220;I think we&#8217;re in a much better place.&#8221; He also didn&#8217;t comment when asked how Pantheon violated the code of conduct.</p>\n<p>After the meeting, Stodolnic told me that both sides agreed that communication could have been handled better and that cooler heads prevailed. Mullenweg wouldn&#8217;t comment when asked whether Pantheon was banned from sponsoring WordCamps in 2017.</p>\n<p>We now know that the official hotel for WordCamp US is an extension of the venue allowing organizers to enforce the code of conduct and sponsorship and principles agreements. It&#8217;s likely that due to this incident, the sponsorship agreement will be amended to specifically prohibit advertising in the official hotel at next year&#8217;s event.</p>\n<p>Pantheon is a six-year old company making inroads in the managed WordPress hosting space. Not being able to sponsor WordCamps in 2017, <a href=\"https://central.wordcamp.org/news/2016/03/28/pantheon-joins-the-wordpress-global-community-sponsorship-program-in-2016/\">as they did in 2016,</a> could derail their momentum in building brand awareness.</p>\n<h2>Is It Worth It to Sponsor WordCamps?</h2>\n<p>Many of the sponsors I spoke to at WordCamp US described what Pantheon did as genius and were disappointed that they didn&#8217;t think of it first. This opens the door to a wider conversation. Is it financially worth it to sponsor WordCamps and are there enough opportunities to see a return on investment?</p>\n<p>Earlier this year, Tony Perez, <span class=\"st\">CEO of Sucuri, started a <a href=\"https://twitter.com/perezbox/status/749283708209799168\">passionate discussion</a> on Twitter around the value of sponsoring WordCamps. As the costs of sponsoring and the number of WordCamps increases, businesses will need to be more selective of which camps they sponsor.<br />\n</span></p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">I think <a href=\"https://twitter.com/hashtag/wordcamp?src=hash\">#wordcamp</a> sponsorships and today\'s businesses will be coming to a cross roads in the the not so distant future.. <a href=\"https://twitter.com/hashtag/wordpress?src=hash\">#wordpress</a></p>\n<p>&mdash; Tony Perez (@perezbox) <a href=\"https://twitter.com/perezbox/status/749283708209799168\">July 2, 2016</a></p></blockquote>\n<p></p>\n<p>One of the <a href=\"https://wptavern.com/state-of-the-word-2016-mullenweg-pushes-calypso-as-future-of-wordpress-interface-proposes-major-changes-to-release-cycle\">major announcements at WordCamp US</a> is that WordCamps will now run finances through a <a href=\"https://make.wordpress.org/community/handbook/wordcamp-organizer/first-steps/budget-and-finances/running-the-money-through-wpcs/\">Public Benefit Corporation</a>. Previously, finances were run through the <a href=\"http://wordpressfoundation.org/\">WordPress Foundation</a>, a 501(c) non-profit entity which <a href=\"https://make.wordpress.org/community/2016/03/02/transitioning-to-wordpress-community-support/\">severely limited</a> what sponsors were able to do at events due to IRS regulations. When the switch occurred earlier this year, the <a href=\"https://make.wordpress.org/community/handbook/wordcamp-organizer-handbook/planning-details/fundraising/wordcamp-sponsorship/#wordcamp-sponsorship-rules-for-2016\">sponsor rules were updated</a> to be less restrictive.</p>\n<p>As WordCamps grow in size, especially WordCamp US, perhaps its time to rethink the benefits that are offered to sponsors to increase the sponsorship&#8217;s value. What sponsorship opportunities would you like to see considered or added for WordCamps?</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 07 Dec 2016 03:00:33 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:44;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:99:\"WPTavern: WordPress 4.7 Introduces Twenty Seventeen Default Theme and WP REST API Content Endpoints\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=64226\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:110:\"https://wptavern.com/wordpress-4-7-introduces-twenty-seventeen-default-theme-and-wp-rest-api-content-endpoints\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7624:\"<a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/12/sarah-vaughan.jpg?ssl=1\"><img src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/12/sarah-vaughan.jpg?resize=1025%2C645&ssl=1\" alt=\"photo credit: Wikimedia Commons\" class=\"size-full wp-image-64229\" /></a>photo credit: <a href=\"https://commons.wikimedia.org/wiki/File:Sarah_Vaughan_-_William_P._Gottlieb_-_No._1.jpg\">Wikimedia Commons</a>\n<p>WordPress 4.7 &#8220;Vaughan&#8221; was <a href=\"https://wordpress.org/news/2016/12/vaughan/\" target=\"_blank\">released</a> today, named in honor of American jazz vocalist Sarah &#8220;Sassy&#8221; Vaughan. This release makes significant improvements to the new theme setup experience, inspiring the tagline: &#8220;Your site, your way.&#8221;</p>\n<p><a href=\"https://wptavern.com/new-wordpress-default-theme-twenty-seventeen-merged-into-4-7\" target=\"_blank\">Twenty Seventeen is making its debut in 4.7</a> as the first default theme designed for business websites. It beautifully showcases new features for theme developers and demonstrates many improvements to the setup process. Twenty Seventeen offers four customizable panels on the front page for displaying existing content, custom logo upload, fullscreen featured images, and brand new core support for video headers.</p>\n<div class=\"wp-video\"><!--[if lt IE 9]><script>document.createElement(\'video\');</script><![endif]--><br />\n<a href=\"https://make.wordpress.org/core/files/2016/10/panels-ui-small.mp4\">https://make.wordpress.org/core/files/2016/10/panels-ui-small.mp4</a></div>\n<h3>Starter Content and Edit Shortcuts</h3>\n<p>WordPress 4.7 gives theme developers the ability to provide <a href=\"https://make.wordpress.org/core/2016/11/30/starter-content-for-themes-in-4-7/\" target=\"_blank\">starter content</a>, such as a business info widget or a sample social icons menu. The content serves as a placeholder but doesn&#8217;t appear on the live site until the user has customized and published it.</p>\n<p>New <a href=\"https://wptavern.com/visible-edit-shortcuts-in-wordpress-4-7-makes-customizing-sites-easier\" target=\"_blank\">visible edit shortcuts</a> display a pencil icon on areas of a theme that can be customized. Clicking the icons will automatically open the correct panel for the setting, which saves users time that might otherwise have been spent hunting around for the right setting to adjust. Theme authors will need to add theme support as well as support for selective refresh in order to take advantage of this new feature.</p>\n<a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/11/CustomizerShortcutButtons.png?ssl=1\"><img src=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/11/CustomizerShortcutButtons.png?resize=1025%2C544&ssl=1\" alt=\"Visible Edit Shortcut Buttons\" class=\"size-full wp-image-63883\" /></a>Visible Edit Shortcut Buttons\n<p>The new starter content and edit shortcuts features, especially when combined, give theme authors the ability to make customization easier and faster for their users. Themes with dozens of customizer options that may have previously seemed complicated to set up may now be more approachable.</p>\n<h3>Improved Menu Building and Custom CSS with Live Previews</h3>\n<p>WordPress 4.7 <a href=\"https://wptavern.com/new-wordpress-feature-proposal-adds-content-authorship-to-menus-in-the-customizer\" target=\"_blank\">adds content authorship to menus in the Customizer</a>. Users can now create new pages while setting up menus, without having to navigate back to the admin. This makes for a smoother workflow when setting up a brand new site.</p>\n<p><a href=\"https://wptavern.com/a-preview-of-the-custom-css-editor-added-to-the-customizer-in-wordpress-4-7\" target=\"_blank\">Custom CSS with live previews</a> is also new in this release. Users can now tweak the appearance of themes and plugins and see the results instantly. Those who have been using Jetpack&#8217;s Custom CSS module should have a seamless migration. The new feature is fairly basic but extensible so <a href=\"https://make.wordpress.org/core/2016/11/26/extending-the-custom-css-editor/\" target=\"_blank\">plugin developers can add additional functionality</a> on top of it.</p>\n<a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/11/WP47CustomizerCSSEditor.png?ssl=1\"><img src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/11/WP47CustomizerCSSEditor.png?resize=1025%2C394&ssl=1\" alt=\"CSS Editor in The WordPress 4.7 Customizer\" class=\"size-full wp-image-63483\" /></a>CSS Editor in The WordPress 4.7 Customizer\n<p>WordPress 4.7 is packed full of many other user-facing improvements that make managing and editing content easier:</p>\n<ul>\n<li>PDF thumbnail previews for better document management</li>\n<li>User admin languages</li>\n<li>Media library is now searchable by file name</li>\n<li>Improved Custom Background Properties UI (<a href=\"https://core.trac.wordpress.org/ticket/22058\" target=\"_blank\">#22058</a>)</li>\n<li><a href=\"https://make.wordpress.org/core/2016/10/28/editor-changes-in-4-7/\" target=\"_blank\">Editor changes</a>: easier access to most-used buttons, improved discovery for keyboard shortcuts in tooltips and dropdowns</li>\n<li>Customizer sliding panels UI is now faster, smoother, and more accessible</li>\n<li>oEmbed support for Facebook posts/activities/photo/videos/media/questions/notes</li>\n</ul>\n<h3>WP REST API Content Endpoints Added to 4.7</h3>\n<p>One of the most exciting improvements to WordPress for developers is the addition of the <a href=\"https://wptavern.com/wp-rest-api-officially-approved-for-merge-into-wordpress-4-7\" target=\"_blank\">WP REST API content endpoints</a> for posts, comments, terms, users, meta, and settings. This API opens up new ways of accessing and presenting WordPress content in themes, plugins, and applications &#8211; both inside and outside of the traditional WordPress interface. The WP REST API now has an <a href=\"https://developer.wordpress.org/rest-api/\" target=\"_blank\">official reference for documentation</a> on WordPress.org.</p>\n<p>A few highlights of additional improvements for developers include the following:</p>\n<ul>\n<li><a href=\"https://wptavern.com/wordpress-4-7-brings-custom-page-template-functionality-to-all-post-types\" target=\"_blank\">Post Type Templates</a> &#8211; custom page template functionality is now available to all post types</li>\n<li><a href=\"https://wptavern.com/wordpress-4-7-will-allow-developers-to-register-custom-bulk-actions-in-admin-list-tables\" target=\"_blank\">Custom bulk actions</a> &#8211; developers can register custom bulk actions for admin list tables</li>\n<li><a href=\"https://make.wordpress.org/core/2016/10/26/registering-your-settings-in-wordpress-4-7/\" target=\"_blank\">Expanded Settings Registration API</a> via register_setting()</li>\n<li><a href=\"https://make.wordpress.org/core/2016/09/08/wp_hook-next-generation-actions-and-filters/\" target=\"_blank\">WP_Hook overhaul</a></li>\n</ul>\n<p>WordPress lead developer Helen Hou-Sandí led the 4.7 release with deputies Jeff Paul and Aaron Jorbin. A record-breaking 482 contributors had props on 4.7 and 205 of them were first-time contributors. More than 100 of those volunteers contributed to the Twenty Seventeen theme. Community translators made it possible for WordPress 4.7 to be available in 52 languages at release time and they also captioned the release video included below in 44 languages. Check out the <a href=\"https://codex.wordpress.org/Version_4.7\" target=\"_blank\">4.7 codex page</a> for a full rundown of all the new features and improvements in this release.</p>\n<p></p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Dec 2016 21:25:53 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:45;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"Post Status: WordPress 4.7, “Vaughan”, released\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=30979\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"https://poststatus.com/wordpress-4-7-released/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:10113:\"<p>WordPress 4.7, “Vaughan”, <a href=\"https://wordpress.org/news/2016/12/vaughan/\">has been released</a>. It’s named, as always, after a famous jazz musician, and this release is named after <a href=\"https://en.wikipedia.org/wiki/Sarah_Vaughan\">Sarah “Sassy” Vaughan</a>, an American jazz singer.</p>\n<p>The Release Lead for WordPress 4.7 was <a href=\"https://helen.blog/\">Helen Hou-Sandí</a> &#8212; who is also a WordPress Lead Developer, and the Director of Platform Experience at 10up. The Deputy Release Leads were <a href=\"https://profiles.wordpress.org/jbpaul17\">Jeff Paul</a>, a Team Lead at XWP, and <a href=\"https://daily.jorb.in/\">Aaron Jorbin</a>, the Director of Engineering at Some Spider. There were more than 475 total contributors to this release, and more than 200 were first time contributors!</p>\n<p>As always, there&#8217;s a <a href=\"http://wordpress.tv/2016/12/06/introducing-wordpress-4-7-vaughan/\">release video</a> that showcases the release highlights. This year, it was produced by Rami Abraham.</p>\n<div id=\"v-AHz0Ca46-1\" class=\"video-player\"><div><img alt=\"Introducing WordPress 4.7\" src=\"https://videos.files.wordpress.com/AHz0Ca46/wp4-7-vaughan-r8-mastered_scruberthumbnail_0.jpg\" width=\"1024\" height=\"576\" /></div><p>Introducing WordPress 4.7</p></div>\n<p>WordPress 4.7 includes so many changes and new features worth highlighting, I will note a few of what I consider the most important and noteworthy, but it is not all-encompassing. This has been the most productive release in a very long time.</p>\n<h3>WordPress REST API Content Endpoints</h3>\n<p>WordPress is now more extensible than ever before, thanks to the WordPress REST API and the Content Endpoints that have shipped with 4.7. The Content Endpoints are stage two of the REST API rollout, after the infrastructure was included <a href=\"https://poststatus.com/wordpress-4-4/\">in WordPress 4.4</a>.</p>\n<p>The Content Endpoints make it so developers can interact with all major content objects of WordPress: posts (including default and custom post types), terms, users, and comments.</p>\n<p>If you&#8217;ve ever wanted to completely bypass the WordPress templating engine, now you can. You can use WordPress as a content store, and create a custom writing interface, or so many other things, thanks to this API that standardizes interfacing with WordPress.</p>\n<p>The implications for external applications are enormous. Third parties can now reliably anticipate how to work with any WordPress site.</p>\n<p>The WordPress REST API has reached a huge milestone, and <a href=\"https://make.wordpress.org/core/2016/10/19/wordpress-rest-api-success-metrics/\">success metrics</a> have been created to track how things are going with it. But the core team already knows there is much left to do.</p>\n<p>With the <a href=\"https://poststatus.com/matt-mullenweg-state-word-2016/\">new development cycle</a> Matt Mullenweg announced at WordCamp US just last week, the REST API will be one of three parts of WordPress that will have a major release dedicated to enhacing it. The goal is to expand the endpoints to include all site management features of WordPress, so that someone (or WordPress itself) could completely rebuild the WordPress administration experience from scratch, using the WordPress REST API.</p>\n<p>I sincerely believe the REST API is a gamechanger for WordPress. Now, it&#8217;s your turn. Build stuff. Show the world what you&#8217;ve made! There will be official WordPress REST API showcase efforts underway soon to capture what folks are building.</p>\n<p>This project would absolutely not have happened without the following people: Ryan McCue and Rachel Baker for leading the effort, Daniel Bachhuber and Joe Hoyle for their constant work and guidance, K. Adam White for a huge 4.7 effort in project management and wrangling, and Helen Hou-Sandí for making the call to include the API in the release.</p>\n<p>Ready to get started with the WordPress REST API? The new <a href=\"https://developer.wordpress.org/rest-api/\">REST API Handbook</a> will be the home for documentation going forward.</p>\n<h3>Twenty Seventeen</h3>\n<p>Twenty Seventeen is the latest default theme for WordPress, and I believe the best since at least Twenty Twelve. The new default theme has a great multi-section front page feature that offers a great solution for small businesses to highlight their work in a single page format, with large featured images throughout.</p>\n<p><img class=\"aligncenter wp-image-26479 size-large\" src=\"https://cdn.poststatus.com/wp-content/uploads/2016/09/twenty-seventeen-promo-752x313.png\" alt=\"twenty-seventeen-promo\" width=\"752\" height=\"313\" /></p>\n<p>Twenty Seventeen was designed by Mel Choyce.</p>\n<h3>Adjusted editor layout</h3>\n<p>Many folks would consider it a minor change, but any change to the WordPress editor is a big one to me. As Andrew Ozz <a href=\"https://make.wordpress.org/core/2016/10/28/editor-changes-in-4-7/\">highlights in the Make Core post</a>, some of the buttons in the default editing toolbar have been moved around, based on statistics of usage.</p>\n<p><img class=\"aligncenter size-large wp-image-30984\" src=\"https://cdn.poststatus.com/wp-content/uploads/2016/12/Screen-Shot-2016-12-06-at-1.24.48-PM-752x447.png\" alt=\"editor-toolbar-rearrangement\" width=\"752\" height=\"447\" /></p>\n<p>Most notably, the headings drop down has been moved to the top row, and strikethrough and horizontal rule buttons have moved down. This is a good step in the right direction in supporting a better and easier to use editor.</p>\n<h3>New Customizer features</h3>\n<p>The WordPress Customizer is another of the three feature focus areas moving forward in WordPress development. And there&#8217;s a lot of new stuff in the Customizer with WordPress 4.7 that you should know about.</p>\n<h4>Video Headers</h4>\n<p>The new default theme supports <a href=\"https://make.wordpress.org/core/2016/11/26/video-headers-in-4-7/\">video headers</a>, a new feature in WordPress, managed within the customizer.</p>\n<h4>Visible Edit Shortcuts</h4>\n<p>The new visible edit shortcuts allow for someone using the customizer to see an icon next to the part of the page that is eligible to be edited in the customizer. It&#8217;s perhaps a small UX addition, but will be very helpful for folks customizing their websites.</p>\n<p><img class=\"aligncenter size-large wp-image-30982\" src=\"https://cdn.poststatus.com/wp-content/uploads/2016/12/Screen-Shot-2016-12-06-at-1.01.09-PM-752x405.png\" alt=\"customize-icon\" width=\"752\" height=\"405\" /></p>\n<h4>Create a Page Within a Menu</h4>\n<p>Finally, you can create pages from within the Menu Customizer. One of the most common site setup steps is to build your menu. But if you haven&#8217;t already created the pages you want to put there, you have to go do that and come back.</p>\n<p>Now users can create a page draft while in the Menu Customizer so that they don&#8217;t have to take unnecessary steps or understand the order WordPress expects. Small wins like this are invaluable for the new user experience.</p>\n<h4>Custom CSS</h4>\n<p>Creating custom CSS straight from the editor has long been a popular Jetpack feature, and it was ported to WordPress core.</p>\n<p><img class=\"aligncenter size-large wp-image-30981\" src=\"https://cdn.poststatus.com/wp-content/uploads/2016/12/Screen-Shot-2016-12-06-at-12.59.04-PM-752x438.png\" alt=\"wordpress-edit-css\" width=\"752\" height=\"438\" /></p>\n<p>This isn&#8217;t exactly what I&#8217;d call a best practice, but it&#8217;s a common one. I&#8217;ve used custom CSS myself many times, especially for small sites where I just wanted to get something small done quickly. This feature brings a common request to core, and helps someone customize their sites quicker and without a third party plugin.</p>\n<h4>Starter content for themes</h4>\n<p>I&#8217;m really excited about the new starter content that WordPress themes can now include. This allows for smarter demos, so that the user better sees what the theme is designed for.</p>\n<p>Helen has a whole post <a href=\"https://make.wordpress.org/core/2016/11/30/starter-content-for-themes-in-4-7/\">describing exactly how it works</a>, but this is another feature that takes something that was not great in WordPress (especially for free themes in the WordPress directory) and drastically improves it.</p>\n<p>I really look forward to seeing this in action, and look forward to see how adoption of this feature impacts both free and commercial WordPress theme ecosystems.</p>\n<h3>Post type templates</h3>\n<p>Pages have long support custom templates for WordPress themes to define, and now this feature has been <a href=\"https://make.wordpress.org/core/2016/11/03/post-type-templates-in-4-7/\">extended to all post types</a>, with opt-in support.</p>\n<p>Now it&#8217;s simple for theme authors to create a variety of templates so that content creators can pick and choose from a layout they want to utilize, just like they&#8217;ve always done for pages.</p>\n<h3>Check out the full field guide</h3>\n<p>WordPress 4.7 packs a lot of punch, and I highly recommend looking through the <a href=\"https://make.wordpress.org/core/2016/12/05/wordpress-4-7-field-guide/\">full field guide</a> on the various changes. I have not covered many of the developer focused features in this post, because Aaron has curated the Make Core posts that do a better job of it.</p>\n<p>Also check out the <a href=\"https://codex.wordpress.org/Version_4.7\">Codex page for WordPress 4.7</a> for more information on features and links to specific tickets.</p>\n<hr />\n<p>WordPress 4.7 is a monumental achievement and is the result of the efforts of hundreds.</p>\n<p>Congratulations to Release Lead Helen Hou-Sandí, the core team, and all contributors. While the scheduled and strict-date releases worked really well and kept WordPress coming out on time every four months or so, I&#8217;m excited to see how the new setup mixes things up for WordPress.</p>\n<p>This was a heck of a way to go out with the previous method.</p>\n<p>Go <a href=\"https://wordpress.org/download/\">download WordPress 4.7</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Dec 2016 19:28:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:46;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:37:\"Dev Blog: WordPress 4.7 “Vaughan”\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=4596\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"https://wordpress.org/news/2016/12/vaughan/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:40344:\"<p>Version 4.7 of WordPress, named “Vaughan” in honor of legendary jazz vocalist Sarah &#8220;Sassy&#8221; Vaughan, is available for download or update in your WordPress dashboard. New features in 4.7 help you get your site set up the way you want it.</p>\n<div id=\"v-AHz0Ca46-1\" class=\"video-player\"><div><img alt=\"Introducing WordPress 4.7\" src=\"https://i1.wp.com/videos.files.wordpress.com/AHz0Ca46/wp4-7-vaughan-r8-mastered_scruberthumbnail_0.jpg?resize=632%2C354&ssl=1\" /></div><p>Introducing WordPress 4.7</p></div>\n<hr />\n<h2>Presenting Twenty Seventeen</h2>\n<p>A brand new default theme brings your site to life with immersive featured images and video headers.</p>\n<p><img class=\"alignnone wp-image-4618 size-large\" src=\"https://i2.wp.com/wordpress.org/news/files/2016/12/4.7-—-Twenty-Seventeen-1.jpg?resize=632%2C356&ssl=1\" /></p>\n<p>Twenty Seventeen focuses on business sites and features a customizable front page with multiple sections. Personalize it with widgets, navigation, social menus, a logo, custom colors, and more. Our default theme for 2017 works great in many languages, on any device, and for a wide range of users.</p>\n<hr />\n<h2>Your Site, Your Way</h2>\n<p>WordPress 4.7 adds new features to the customizer to help take you through the initial setup of a theme, with non-destructive live previews of all your changes in one uninterrupted workflow.</p>\n<h3>Theme Starter Content</h3>\n<div class=\"wp-video\"><!--[if lt IE 9]><script>document.createElement(\'video\');</script><![endif]-->\n<a href=\"https://wordpress.org/news/files/2016/12/starter-content.mp4\">https://wordpress.org/news/files/2016/12/starter-content.mp4</a></div>\n<p>To help give you a solid base to build from, individual themes can provide starter content that appears when you go to customize your brand new site. This can range from placing a business information widget in the best location to providing a sample menu with social icon links to a static front page complete with beautiful images. Don’t worry &#8211; nothing new will appear on the live site until you’re ready to save and publish your initial theme setup.</p>\n<div>\n<h3>Edit Shortcuts</h3>\n<div class=\"wp-video\"><a href=\"https://wordpress.org/news/files/2016/12/edit-shortcuts.mp4\">https://wordpress.org/news/files/2016/12/edit-shortcuts.mp4</a></div>\n<p>Visible icons appear to show you which parts of your site can be customized while live previewing. Click on a shortcut and get straight to editing. Paired with starter content, getting started with customizing your site is faster than ever.</p>\n</div>\n<div>\n<h3>Video Headers</h3>\n<div class=\"wp-video\"><a href=\"https://wordpress.org/news/files/2016/12/video-headers.mp4\">https://wordpress.org/news/files/2016/12/video-headers.mp4</a></div>\n<p>Sometimes a big atmospheric video as a moving header image is just what you need to showcase your wares; go ahead and try it out with Twenty Seventeen. Need some video inspiration? Try searching for sites with video headers available for download and use.</p>\n</div>\n<div></div>\n<div>\n<h3>Smoother Menu Building</h3>\n<p><img class=\"wp-image-4606 size-medium alignright\" src=\"https://i1.wp.com/wordpress.org/news/files/2016/12/4.7-—-Nav.jpg?resize=300%2C158&ssl=1\" /></p>\n<p>Many menus for sites contain links to the pages of your site, but what happens when you don’t have any pages yet? Now you can add new pages while building menus instead of leaving the customizer and abandoning your changes. Once you’ve published your customizations, you’ll have new pages ready for you to fill with content.</p>\n</div>\n<div>\n<h3>Custom CSS</h3>\n<p><img class=\"wp-image-4607 size-medium alignright\" src=\"https://i1.wp.com/wordpress.org/news/files/2016/12/4.7-—-CSS.jpg?resize=300%2C158&ssl=1\" /></p>\n<p>Sometimes you just need a few visual tweaks to make your site perfect. WordPress 4.7 allows you to add custom CSS and instantly see how your changes affect your site. The live preview allows you to work quickly without page refreshes slowing you down.</p>\n</div>\n<div></div>\n<hr />\n<div>\n<h3>PDF Thumbnail Previews</h3>\n<p><img class=\"wp-image-4609 size-medium alignright\" src=\"https://i1.wp.com/wordpress.org/news/files/2016/12/4.7-—-PDF.jpg?resize=300%2C158&ssl=1\" /></p>\n<p>Managing your document collection is easier with WordPress 4.7. Uploading PDFs will generate thumbnail images so you can more easily distinguish between all your documents.</p>\n</div>\n<div>\n<h3>Dashboard in your language</h3>\n<p><img class=\"wp-image-4608 size-medium alignright\" src=\"https://i2.wp.com/wordpress.org/news/files/2016/12/4.7-—-Language.jpg?resize=300%2C158&ssl=1\" /></p>\n<p>Just because your site is in one language doesn’t mean that everybody helping manage it prefers that language for their admin. Add more languages to your site and a user language option will show up in your user’s profiles.</p>\n</div>\n<div></div>\n<hr />\n<h2>Introducing REST API Content Endpoints</h2>\n<p>WordPress 4.7 comes with REST API endpoints for posts, comments, terms, users, meta, and settings.</p>\n<p><img class=\"size-large wp-image-4600 alignnone\" src=\"https://i2.wp.com/wordpress.org/news/files/2016/12/4.7-—-API.jpg?resize=632%2C205&ssl=1\" alt=\"\" /></p>\n<p>Content endpoints provide machine-readable external access to your WordPress site with a clear, standards-driven interface, paving the way for new and innovative methods of interacting with sites through plugins, themes, apps, and beyond. Ready to get started with development? <a href=\"https://developer.wordpress.org/rest-api/reference/\">Check out the REST API reference.</a></p>\n<hr />\n<h2>Even More Developer Happiness <img src=\"https://s.w.org/images/core/emoji/2.2.1/72x72/1f60a.png\" alt=\"?\" class=\"wp-smiley\" /></h2>\n<h3><a href=\"https://make.wordpress.org/core/2016/11/03/post-type-templates-in-4-7/\">Post Type Templates</a></h3>\n<p>By opening up the page template functionality to all post types, theme developers have even more flexibility with the WordPress template hierarchy.</p>\n<h3>More Theme API Goodies</h3>\n<p>WordPress 4.7 includes <a href=\"https://make.wordpress.org/core/2016/09/09/new-functions-hooks-and-behaviour-for-theme-developers-in-wordpress-4-7/\">new functions, hooks, and behavior</a> for theme developers.</p>\n<h3><a href=\"https://make.wordpress.org/core/2016/10/04/custom-bulk-actions/\">Custom Bulk Actions</a></h3>\n<p>List tables, now with more than bulk edit and delete.</p>\n<h3><a href=\"https://make.wordpress.org/core/2016/09/08/wp_hook-next-generation-actions-and-filters/\"><code>WP_Hook</code></a></h3>\n<p>The code that lies beneath actions and filters has been overhauled and modernized, fixing bugs along the way.</p>\n<h3>Settings Registration API</h3>\n<p>register_setting() <a href=\"https://make.wordpress.org/core/2016/10/26/registering-your-settings-in-wordpress-4-7/\">has been enhanced</a> to include type, description, and REST API visibility.</p>\n<h3><a href=\"https://make.wordpress.org/core/2016/10/12/customize-changesets-technical-design-decisions/\">Customize Changesets</a></h3>\n<p>Customize changesets make changes in the customizer persistent, like autosave drafts. They also make exciting new features like starter content possible.</p>\n<hr />\n<h2>The Squad</h2>\n<p>This release was led by <a href=\"https://helen.blog\">Helen Hou-Sandí</a>, backed up by <a href=\"https://profiles.wordpress.org/jbpaul17\">Jeff Paul</a> and <a href=\"http://aaron.jorb.in/\">Aaron Jorbin</a> as Release Deputies, and with the help of these fine individuals. There are 482 contributors with props in this release—the most ever—with 205 of them contributing for the first time. Pull up some sassy Sarah Vaughan on your music service of choice, and check out some of their profiles:</p>\n<a href=\"https://profiles.wordpress.org/aaroncampbell\">Aaron D. Campbell</a>, <a href=\"https://profiles.wordpress.org/abrightclearweb\">abrightclearweb</a>, <a href=\"https://profiles.wordpress.org/ibachal\">Achal Jain</a>, <a href=\"https://profiles.wordpress.org/achbed\">achbed</a>, <a href=\"https://profiles.wordpress.org/acmethemes\">Acme Themes</a>, <a href=\"https://profiles.wordpress.org/adamsilverstein\">Adam Silverstein</a>, <a href=\"https://profiles.wordpress.org/adammacias\">adammacias</a>, <a href=\"https://profiles.wordpress.org/mrahmadawais\">Ahmad Awais</a>, <a href=\"https://profiles.wordpress.org/ahmadawais\">ahmadawais</a>, <a href=\"https://profiles.wordpress.org/airesvsg\">airesvsg</a>, <a href=\"https://profiles.wordpress.org/ajoah\">ajoah</a>, <a href=\"https://profiles.wordpress.org/akibjorklund\">Aki Bj&#246;rklund</a>, <a href=\"https://profiles.wordpress.org/akshayvinchurkar\">AkshayVinchurkar</a>, <a href=\"https://profiles.wordpress.org/xknown\">Alex Concha</a>, <a href=\"https://profiles.wordpress.org/xavortm\">Alex Dimitrov</a>, <a href=\"https://profiles.wordpress.org/ironpaperweight\">Alex Hon</a>, <a href=\"https://profiles.wordpress.org/alex27\">alex27</a>, <a href=\"https://profiles.wordpress.org/allancole\">allancole</a>, <a href=\"https://profiles.wordpress.org/arush\">Amanda Rush</a>, <a href=\"https://profiles.wordpress.org/afercia\">Andrea Fercia</a>, <a href=\"https://profiles.wordpress.org/andrewp-2\">Andreas Panag</a>, <a href=\"https://profiles.wordpress.org/nacin\">Andrew Nacin</a>, <a href=\"https://profiles.wordpress.org/azaozz\">Andrew Ozz</a>, <a href=\"https://profiles.wordpress.org/rarst\">Andrey \"Rarst\" Savchenko</a>, <a href=\"https://profiles.wordpress.org/andizer\">Andy Meerwaldt</a>, <a href=\"https://profiles.wordpress.org/kelderic\">Andy Mercer</a>, <a href=\"https://profiles.wordpress.org/andy\">Andy Skelton</a>, <a href=\"https://profiles.wordpress.org/aniketpant\">Aniket Pant</a>, <a href=\"https://profiles.wordpress.org/anilbasnet\">Anil Basnet</a>, <a href=\"https://profiles.wordpress.org/ankit-k-gupta\">Ankit K Gupta</a>, <a href=\"https://profiles.wordpress.org/ahortin\">Anthony Hortin</a>, <a href=\"https://profiles.wordpress.org/antisilent\">antisilent</a>, <a href=\"https://profiles.wordpress.org/atimmer\">Anton Timmermans</a>, <a href=\"https://profiles.wordpress.org/zuige\">Antti Kuosmanen</a>, <a href=\"https://profiles.wordpress.org/apokalyptik\">apokalyptik</a>, <a href=\"https://profiles.wordpress.org/artoliukkonen\">artoliukkonen</a>, <a href=\"https://profiles.wordpress.org/ideag\">Arunas Liuiza</a>, <a href=\"https://profiles.wordpress.org/attitude\">attitude</a>, <a href=\"https://profiles.wordpress.org/backermann\">backermann</a>, <a href=\"https://profiles.wordpress.org/b-07\">Bappi</a>, <a href=\"https://profiles.wordpress.org/bcole808\">Ben Cole</a>, <a href=\"https://profiles.wordpress.org/kau-boy\">Bernhard Kau</a>, <a href=\"https://profiles.wordpress.org/binarymoon\">BinaryMoon</a>, <a href=\"https://profiles.wordpress.org/birgire\">Birgir Erlendsson (birgire)</a>, <a href=\"https://profiles.wordpress.org/bjornw\">BjornW</a>, <a href=\"https://profiles.wordpress.org/bobbingwide\">bobbingwide</a>, <a href=\"https://profiles.wordpress.org/boblinthorst\">boblinthorst</a>, <a href=\"https://profiles.wordpress.org/boboudreau\">boboudreau</a>, <a href=\"https://profiles.wordpress.org/gitlost\">bonger</a>, <a href=\"https://profiles.wordpress.org/boonebgorges\">Boone B. Gorges</a>, <a href=\"https://profiles.wordpress.org/bradyvercher\">Brady Vercher</a>, <a href=\"https://profiles.wordpress.org/brainstormforce\">Brainstorm Force</a>, <a href=\"https://profiles.wordpress.org/kraftbj\">Brandon Kraft</a>, <a href=\"https://profiles.wordpress.org/brianhogg\">Brian Hogg</a>, <a href=\"https://profiles.wordpress.org/krogsgard\">Brian Krogsgard</a>, <a href=\"https://profiles.wordpress.org/bronsonquick\">Bronson Quick</a>, <a href=\"https://profiles.wordpress.org/sixhours\">Caroline Moore</a>, <a href=\"https://profiles.wordpress.org/caseypatrickdriscoll\">Casey Driscoll</a>, <a href=\"https://profiles.wordpress.org/caspie\">Caspie</a>, <a href=\"https://profiles.wordpress.org/chaos-engine\">Chaos Engine</a>, <a href=\"https://profiles.wordpress.org/cheeserolls\">cheeserolls</a>, <a href=\"https://profiles.wordpress.org/chesio\">chesio</a>, <a href=\"https://profiles.wordpress.org/ketuchetan\">chetansatasiya</a>, <a href=\"https://profiles.wordpress.org/choongsavvii\">choong</a>, <a href=\"https://profiles.wordpress.org/chouby\">Chouby</a>, <a href=\"https://profiles.wordpress.org/chredd\">chredd</a>, <a href=\"https://profiles.wordpress.org/chrisjean\">Chris Jean</a>, <a href=\"https://profiles.wordpress.org/cmmarslender\">Chris Marslender</a>, <a href=\"https://profiles.wordpress.org/chris_d2d\">Chris Smith</a>, <a href=\"https://profiles.wordpress.org/chrisvanpatten\">Chris Van Patten</a>, <a href=\"https://profiles.wordpress.org/chriswiegman\">Chris Wiegman</a>, <a href=\"https://profiles.wordpress.org/chriscct7\">chriscct7</a>, <a href=\"https://profiles.wordpress.org/chriseverson\">chriseverson</a>, <a href=\"https://profiles.wordpress.org/needle\">Christian Wach</a>, <a href=\"https://profiles.wordpress.org/christophherr\">Christoph Herr</a>, <a href=\"https://profiles.wordpress.org/clarionwpdeveloper\">Clarion Technologies</a>, <a href=\"h