org/shprink\">shprink</a>, <a href=\"https://profiles.wordpress.org/simonlampen\">simonlampen</a>, <a href=\"https://profiles.wordpress.org/skippy\">skippy</a>, <a href=\"https://profiles.wordpress.org/smerriman\">smerriman</a>, <a href=\"https://profiles.wordpress.org/smyoon315\">smyoon315</a>, <a href=\"https://profiles.wordpress.org/snacking\">snacking</a>, <a href=\"https://profiles.wordpress.org/soean\">Soeren Wrede</a>, <a href=\"https://profiles.wordpress.org/solal\">solal</a>, <a href=\"https://profiles.wordpress.org/sstoqnov\">Stanimir Stoyanov</a>, <a href=\"https://profiles.wordpress.org/metodiew\">Stanko Metodiev</a>, <a href=\"https://profiles.wordpress.org/sharkomatic\">Steph</a>, <a href=\"https://profiles.wordpress.org/sswells\">Steph Wells</a>, <a href=\"https://profiles.wordpress.org/sillybean\">Stephanie Leary</a>, <a href=\"https://profiles.wordpress.org/netweb\">Stephen Edgar</a>, <a href=\"https://profiles.wordpress.org/stephenharris\">Stephen Harris</a>, <a href=\"https://profiles.wordpress.org/stevenkword\">Steven Word</a>, <a href=\"https://profiles.wordpress.org/stevenlinx\">stevenlinx</a>, <a href=\"https://profiles.wordpress.org/stubgo\">stubgo</a>, <a href=\"https://profiles.wordpress.org/sudar\">Sudar Muthu</a>, <a href=\"https://profiles.wordpress.org/patilswapnilv\">Swapnil V. Patil</a>, <a href=\"https://profiles.wordpress.org/takahashi_fumiki\">Takahashi Fumiki</a>, <a href=\"https://profiles.wordpress.org/miyauchi\">Takayuki Miyauchi</a>, <a href=\"https://profiles.wordpress.org/karmatosed\">Tammie Lister</a>, <a href=\"https://profiles.wordpress.org/tapsboy\">tapsboy</a>, <a href=\"https://profiles.wordpress.org/tlovett1\">Taylor Lovett</a>, <a href=\"https://profiles.wordpress.org/team\">team</a>, <a href=\"https://profiles.wordpress.org/tg29359\">tg29359</a>, <a href=\"https://profiles.wordpress.org/tharsheblows\">tharsheblows</a>, <a href=\"https://profiles.wordpress.org/the\">the</a>, <a href=\"https://profiles.wordpress.org/themeshaper\">themeshaper</a>, <a href=\"https://profiles.wordpress.org/thenbrent\">thenbrent</a>, <a href=\"https://profiles.wordpress.org/thomaswm\">thomaswm</a>, <a href=\"https://profiles.wordpress.org/tfrommen\">Thorsten Frommen</a>, <a href=\"https://profiles.wordpress.org/tierra\">tierra</a>, <a href=\"https://profiles.wordpress.org/tnash\">Tim Nash</a>, <a href=\"https://profiles.wordpress.org/timmydcrawford\">timmydcrawford</a>, <a href=\"https://profiles.wordpress.org/timothyblynjacobs\">Timothy Jacobs</a>, <a href=\"https://profiles.wordpress.org/tkama\">Tkama</a>, <a href=\"https://profiles.wordpress.org/tnegri\">tnegri</a>, <a href=\"https://profiles.wordpress.org/tomauger\">Tom Auger</a>, <a href=\"https://profiles.wordpress.org/tjnowell\">Tom J Nowell</a>, <a href=\"https://profiles.wordpress.org/tomdxw\">tomdxw</a>, <a href=\"https://profiles.wordpress.org/toro_unit\">Toro_Unit (Hiroshi Urabe)</a>, <a href=\"https://profiles.wordpress.org/zodiac1978\">Torsten Landsiedel</a>, <a href=\"https://profiles.wordpress.org/transl8or\">transl8or</a>, <a href=\"https://profiles.wordpress.org/traversal\">traversal</a>, <a href=\"https://profiles.wordpress.org/wpsmith\">Travis Smith</a>, <a href=\"https://profiles.wordpress.org/nmt90\">Triet Minh</a>, <a href=\"https://profiles.wordpress.org/trishasalas\">Trisha Salas</a>, <a href=\"https://profiles.wordpress.org/tristangemus\">tristangemus</a>, <a href=\"https://profiles.wordpress.org/truongwp\">Truong Giang</a>, <a href=\"https://profiles.wordpress.org/tsl143\">tsl143</a>, <a href=\"https://profiles.wordpress.org/tywayne\">Ty Carlson</a>, <a href=\"https://profiles.wordpress.org/grapplerulrich\">Ulrich</a>, <a href=\"https://profiles.wordpress.org/utkarshpatel\">Utkarsh</a>, <a href=\"https://profiles.wordpress.org/valeriutihai\">Valeriu Tihai</a>, <a href=\"https://profiles.wordpress.org/vishalkakadiya\">Vishal Kakadiya</a>, <a href=\"https://profiles.wordpress.org/voldemortensen\">voldemortensen</a>, <a href=\"https://profiles.wordpress.org/vrundakansara-1\">Vrunda Kansara</a>, <a href=\"https://profiles.wordpress.org/webbgaraget\">webbgaraget</a>, <a href=\"https://profiles.wordpress.org/webmandesign\">WebMan Design &#124; Oliver Juhas</a>, <a href=\"https://profiles.wordpress.org/websupporter\">websupporter</a>, <a href=\"https://profiles.wordpress.org/westonruter\">Weston Ruter</a>, <a href=\"https://profiles.wordpress.org/earnjam\">William Earnhardt</a>, <a href=\"https://profiles.wordpress.org/williampatton\">williampatton</a>, <a href=\"https://profiles.wordpress.org/wolly\">Wolly aka Paolo Valenti</a>, <a href=\"https://profiles.wordpress.org/yale01\">yale01</a>, <a href=\"https://profiles.wordpress.org/yoavf\">Yoav Farhi</a>, <a href=\"https://profiles.wordpress.org/yogasukma\">Yoga Sukma</a>, <a href=\"https://profiles.wordpress.org/youknowriad\">youknowriad</a>, <a href=\"https://profiles.wordpress.org/oxymoron\">Zach Wills</a>, <a href=\"https://profiles.wordpress.org/tollmanz\">Zack Tollman</a>, <a href=\"https://profiles.wordpress.org/vanillalounge\">Ze Fontainhas</a>, <a href=\"https://profiles.wordpress.org/zhildzik\">zhildzik</a>, and <a href=\"https://profiles.wordpress.org/zsusag\">zsusag</a>.\n<p>&nbsp;<br />\nSpecial thanks go to <a href=\"https://ramiabraham.com/\">Rami Abraham</a> for producing the release video and the many fine haiku we saw in the <a href=\"https://wordpress.org/news/2016/10/wordpress-4-7-beta-1/\">beta</a> and <a href=\"https://wordpress.org/news/2016/11/wordpress-4-7-release-candidate/\">RC</a> announcement posts.</p>\n<p>Finally, thanks to all the community translators who worked on WordPress 4.7. Their efforts bring WordPress 4.7 fully translated to 52 languages at release time with more on the way. Additionally, the WordPress 4.7 release video has been captioned into 44 languages.</p>\n<p>If you want to follow along or help out, check out <a href=\"https://make.wordpress.org/\">Make WordPress</a> and our <a href=\"https://make.wordpress.org/core/\">core development blog</a>. Thanks for choosing WordPress &#8211; we hope you enjoy!</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Dec 2016 19:27:41 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Helen Hou-Sandi\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:47;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:135:\"WPTavern: State of the Word 2016: Mullenweg Pushes Calypso as Future of WordPress’ Interface, Proposes Major Changes to Release Cycle\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=64185\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:141:\"https://wptavern.com/state-of-the-word-2016-mullenweg-pushes-calypso-as-future-of-wordpress-interface-proposes-major-changes-to-release-cycle\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:14793:\"<a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/12/sotw-2016.jpg?ssl=1\"><img src=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/12/sotw-2016.jpg?resize=1025%2C487&ssl=1\" alt=\"photo credit: WordCamp US organizing team\" class=\"size-full wp-image-64217\" /></a>photo credit: <a href=\"https://twitter.com/WordCampUS/status/805156416935882752\">WordCamp US organizing team</a>\n<p>Philadelphia welcomed 1,923 attendees to WordCamp US this weekend with an additional 2,028 enthusiasts watching via live stream. Matt Mullenweg delivered his 11th annual State of the Word address to a rapt audience ready to celebrate WordPress&#8217; progress over the past year and hear the project leader&#8217;s vision for 2017.</p>\n<p>He began by thanking sponsors and volunteers who made the event possible by covering the bulk of the $516 actual cost per person. Mullenweg said sponsors cover roughly 85-95% of the cost of WordCamps worldwide. In 2016, the events sold a total 36,000 tickets, with costs subsidized by more than 1,000 sponsors.</p>\n<p>Mullenweg said meetups are the leading indicator for WordCamps and these events have had the fastest growth the community has seen in five or six years. More than 62,566 people attended a local meetup in 58 countries and roughly one third of those were new members.</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">It’s been a great year for WordCamps and meetups &#8211; 115 total WordCamps hosted in 41 different countries. <a href=\"https://twitter.com/hashtag/wcus?src=hash\">#wcus</a> <a href=\"https://t.co/yVGkT0j52C\">pic.twitter.com/yVGkT0j52C</a></p>\n<p>&mdash; WordCamp US (@WordCampUS) <a href=\"https://twitter.com/WordCampUS/status/805156784763715584\">December 3, 2016</a></p></blockquote>\n<p></p>\n<h3>WordPress Foundation to Create WordPress Community Support Subsidiary</h3>\n<p>In order to better accommodate the extraordinary growth of the global community, the WordPress Foundation will be restructuring its management of WordCamps. In 2016 the Foundation took in an estimated $4.3 million, up from $2.8 million in 2015, with 99.9% of those funds related to WordCamps. Mullenweg announced that the 501c nonprofit will move WordCamps to its own company, WordPress Community Support, forming a PBC (Public Benefit Corporation) that is fully owned by the Foundation.</p>\n<p>He explained that if certain things happened at WordCamps it could endanger the overall Foundation, so WordCamps will now be managed under their own entity where the events will have a little more flexibility in how they do things. The Foundation plans to support some like-minded nonprofits that are aligned with the overall education mission of the organization, including <a href=\"http://www.hackthehood.org/\" target=\"_blank\">Hack the Hood</a>, <a href=\"https://archive.org/index.php\" target=\"_blank\">Internet Archive</a>, and <a href=\"http://www.blackgirlscode.com/\" target=\"_blank\">Black Girls Code</a>. In 2017 the Foundation will also begin promoting hackathons to help nonprofits and NGO&#8217;s.</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">The Foundation will focus on supporting like-minded non-profits, education/workshops, and hackathons that benefit non-profits/NGOs. <a href=\"https://twitter.com/hashtag/wcus?src=hash\">#wcus</a> <a href=\"https://t.co/6VfdP82KuM\">pic.twitter.com/6VfdP82KuM</a></p>\n<p>&mdash; WordCamp US (@WordCampUS) <a href=\"https://twitter.com/WordCampUS/status/805158678353608704\">December 3, 2016</a></p></blockquote>\n<p></p>\n<h3>Internationalization is Driving an Increase in Plugin Usage</h3>\n<p>Mullenweg shared a few stats about the plugin directory, which will soon be launching a new design with revamped search functionality. This year has seen a 20% increase in active plugin usage and a 34% increase in plugin downloads totaling 1.48 billion, which Mullenweg attributed to a spike in internationalization efforts over the past year. The number of translation contributors has grown from 5,000 in April 2015 to 17,000 as of November 2016.</p>\n<p>This year there were 1,598 plugins with language packs (up from 314 last year) and 1224 themes with language packs (up from 641 last year). Mullenweg noted that 2/3 of the world speaks one of 12 languages with native fluency and that WordPress covers all of these and many more. In fact, the 4.6 release shipped with support for 50 available languages. WordPress&#8217; top 10 plugins are now 82% complete in the top 12 languages.</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">The top 10 plugins are 82% complete in the top 12 languages. <a href=\"https://twitter.com/hashtag/wcus?src=hash\">#wcus</a> <a href=\"https://t.co/LnpEGv0p7o\">pic.twitter.com/LnpEGv0p7o</a></p>\n<p>&mdash; WordCamp US (@WordCampUS) <a href=\"https://twitter.com/WordCampUS/status/805161007349985280\">December 3, 2016</a></p></blockquote>\n<p></p>\n<h3>Mullenweg Continues to Push Calypso as the Future of the WordPress Interface</h3>\n<p>During the <a href=\"https://wptavern.com/state-of-the-word-2015-javascript-and-api-driven-interfaces-are-the-future-of-wordpress\" target=\"_blank\">2015 State of the Word</a>, Mullenweg gave attendees a homework assignment to &#8220;learn JavaScript deeply&#8221; and <a href=\"https://youtu.be/TX6dXRL-jPU?t=59m14s\" target=\"_blank\">promised to submit a JavaScript patch before 4.7</a> came out. He submitted his first pull request to Calypso yesterday, Automattic&#8217;s from-scratch rewrite of WP admin using Node and React.</p>\n<p>WordPress.com users have widely adopted the new interface for publishing. Mullenweg shared statistics showing that 68% of posts went through Calypso since its launch, 17% via mobile, and 15% through the traditional wp-admin. Mobile app and mobile browser usage are also up. &#8220;We now need to start thinking about mobile devices as the primary way people are going to interact with WordPress in the future,&#8221; Mullenweg said.</p>\n<p>From the time it launched, Mullenweg has said that Calypso, or something like it, would be the future of the WordPress interface. He reiterated this in his 2016 address and has committed some of Automattic&#8217;s JavaScript developers from the Calypso team to contribute full-time to core.</p>\n<p>If Calypso has a chance at becoming a promising replacement for the WordPress admin, its creators will need to broaden its interoperability with the WordPress plugin ecosystem. Mullenweg announced that Calypso is now plugin aware and is open to plugins with over 1M active sites.</p>\n<p>The next step on Calypso&#8217;s roadmap is to bring in support for Automattic&#8217;s plugins &#8211; WooCommerce, Akismet, Jetpack, and VaultPress. Mullenweg said the big focus for 2017 is to make plugins Calypso-aware, starting with a handful of the most popular ones before opening it up to all plugins.</p>\n<p>&#8220;The hope is that Calypso, or something like it, is actually what becomes the interface that drives WordPress,&#8221; Mullenweg said. Since no one is currently building anything like Calypso and targeting core, it looks like the technology behind WordPress.com will be driving the evolution of WordPress in 2017.</p>\n<p>If Mullenweg&#8217;s goal is to make Calypso the primary publishing engine for core WordPress, one of the major challenges will be getting plugin developers on board with building compatibility for what is currently an Automattic product. What are the implications of contributing to greater Calypso adoption? If core brings in the Calypso interface in the future, would Automattic push to include its Reader and other WordPress.com functionality, as it has in the mobile apps? These are questions developers will need to weigh when considering whether to pursue a more application-type experience via the Calypso interface.</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">What\'s next for Calypso? We\'ll start bringing <a href=\"https://twitter.com/automattic\">@Automattic</a>\'s plugins in. <a href=\"https://twitter.com/hashtag/wcus?src=hash\">#wcus</a> <a href=\"https://t.co/RL8ZduRczM\">pic.twitter.com/RL8ZduRczM</a></p>\n<p>&mdash; WordCamp US (@WordCampUS) <a href=\"https://twitter.com/WordCampUS/status/805165388006887424\">December 3, 2016</a></p></blockquote>\n<p></p>\n<h3>WordPress Recommends Hosts Offering PHP 7+ and HTTPS by Default</h3>\n<p>WordPress core continues to update its recommendations and requirements with the help of hosts who are adopting the latest technologies. The <a href=\"https://wordpress.org/about/requirements/\" target=\"_blank\">official recommendation for WordPress hosting</a> is now PHP 7 or higher. After WordPress.com switched to be 100% on PHP 7, Mullenweg said the network&#8217;s performance doubled and CPU load fell in half. Just 4% of self-hosted sites are on PHP 7, but the new recommendation should help move more hosts towards getting their customers updated.</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\"><a href=\"https://t.co/VrQffeOtG0\">https://t.co/VrQffeOtG0</a> has been 100% switched over to PHP7, bringing significant performance improvements. <a href=\"https://twitter.com/hashtag/wcus?src=hash\">#wcus</a> <a href=\"https://t.co/MChiS9QBJh\">pic.twitter.com/MChiS9QBJh</a></p>\n<p>&mdash; WordCamp US (@WordCampUS) <a href=\"https://twitter.com/WordCampUS/status/805164029371158528\">December 3, 2016</a></p></blockquote>\n<p></p>\n<p>Beginning in 2017, WordPress will have progressive enhancement for certain features that are only available for encrypted sites. Mullenweg announced that WordPress.org is now tracking HTTPS adoption. So far 11.45% of active WordPress websites are on HTTPS and <a href=\"https://wptavern.com/wordpress-will-only-recommend-hosting-companies-offering-ssl-by-default-in-2017\" target=\"_blank\">the project will no longer recommend hosts that do not offer it by default</a>. &#8220;We want to bring more of the web to be secure, which is especially important in the post-Snowden era,&#8221; he said.</p>\n<h3>Trying New Things: Major Changes Coming to WordPress&#8217; Core Release Cycle</h3>\n<p>WordPress 4.7 release lead Helen Hou-Sandí joined Mullenweg on stage to highlight a few of the features and improvements that will be coming in the official release on Tuesday. The release is arguably one of the most exciting and successful updates for WordPress in some time, but Mullenweg has a new strategy for core development in 2017.</p>\n<p>&#8220;We&#8217;re at a junction for WordPress where what got us here wont get us there,&#8221; Mullenweg said, after highlighting how the software&#8217;s market share has grown from 13.1% to 27.2% in the past five years.</p>\n<p>Mullenweg proposed a new structure for WordPress releases where design and user testing will lead the way. &#8220;I&#8217;m putting back on the &#8216;product lead&#8217; hat for 2017,&#8221; he said. The upcoming year will have no set release schedule. Mullenweg is upending WordPress&#8217; predictable release cycle in favor of tackling some larger items on the to-do list. He said the focus will be on performance and fixes to existing functionality in three main focus areas: WP REST API, the Editor, and the Customizer.</p>\n<p>Mullenweg said he is particularly interested in getting first-party usage of the REST API in the admin, in hopes of having it evolve to something the project can use for the next decade. If it doesn&#8217;t, he said core will consider bringing it back into a plugin specifically for developers.</p>\n<p>Mullenweg said he feels the editor does not represent the core of WordPress publishing, a sentiment that many users agree with. He hopes to steer it toward a more block-based approach that unifies widgets and includes an interface for shortcodes.</p>\n<p>Mullenweg&#8217;s vision for the Customizer is to see all aspects of WordPress become more instant and provide the same interface and UI affordances as the editor. He announced that Ephox, the company behind TinyMCE, has agreed to work with the project to improve the core editing experience.</p>\n<p>Shifting from a time-based release cycle to one that is more project-based is a major departure from WordPress&#8217; previous release philosophy of &#8220;Deadlines are not arbitrary.&#8221; The project&#8217;s <a href=\"https://wordpress.org/about/philosophy/\" target=\"_blank\">philosophy page</a> identifies the practice of delaying releases for one more feature as a &#8220;rabbit hole&#8221; that has been tested and found to be unpleasant. The new approach to core development makes no guarantee that WordPress will have any releases in 2017.</p>\n<p>If the experiment is not a success, the project&#8217;s days of frequent and fast iteration may be over for awhile. Mullenweg is willing to risk it in hopes of being able to provide more product-based leadership that will distinguish WordPress from its proprietary competitors.</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">Words of wisdom from <a href=\"https://twitter.com/kristatippett\">@kristatippett</a>: \"We only learn to walk when we risk falling down&#8211;\" <a href=\"https://twitter.com/hashtag/wcus?src=hash\">#wcus</a> <a href=\"https://t.co/6t5sD6Xjbm\">pic.twitter.com/6t5sD6Xjbm</a></p>\n<p>&mdash; WordCamp US (@WordCampUS) <a href=\"https://twitter.com/WordCampUS/status/805170327726780416\">December 3, 2016</a></p></blockquote>\n<p></p>\n<p>&#8220;I think we&#8217;re trying to counter stagnation,&#8221; Mullenweg said when asked about the new approach to releases in the Q&amp;A segment. &#8220;Even though we&#8217;ve had lots of releases, certain parts of WordPress have stagnated and haven&#8217;t made the leaps that they could.&#8221;  He suggested that being part of a feature plugin team will give developers a way to be involved in more active releases and continue to build momentum for eventual inclusion of their projects in core.</p>\n<p>Mullenweg plans to identify a tech lead and a design lead and will be working with them as the overall product lead. He envisions that when one area of WordPress gets to the point where the software can ship significant user-facing improvements, a release will be born.</p>\n<p>&#8220;We&#8217;re at the point now where the steps WordPress needs to take are more significant to get the other 73% of the web it doesn&#8217;t have yet,&#8221; Mullenweg said.</p>\n<p>In a return to WordPress&#8217; poetic roots, he concluded by reading a poem called <a href=\"https://www.poets.org/poetsorg/poem/praise-song-day\" target=\"_blank\">Praise Song</a> for the Day by Elizabeth Alexander.</p>\n<p>The video of the State of the Word address will soon be available on <a href=\"https://www.youtube.com/channel/UCpJf6LGZ0a4n9Lj4aVt9spg\" target=\"_blank\">WordPress&#8217; new YouTube channel</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 04 Dec 2016 18:50:17 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:48;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"Post Status: Matt Mullenweg State of the Word, 2016\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=30865\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"https://poststatus.com/matt-mullenweg-state-word-2016/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:16802:\"<p>Matt Mullenweg just completed the 2016 State of the Word presentation at WordCamp US 2016.</p>\n<p>This year, Matt focused on a variety of important topics, including the state of user experience in WordPress today, goals for future interface improvements, a WordPress growth council, internationalization gains, the further proliferation of secure websites, and important changes to the WordPress development process.</p>\n<h3>WordCamp US in Philadelphia</h3>\n<p>Matt began his talk by thanking the city of Philadelphia for being a great host of the first two WordCamp US events, as well as the sponsors, organizers, and volunteers that helped make WordCamp US one of the most successful and smoothest run WordCamps ever.</p>\n<p>He also said the per person cost for WordCamp US is over $500 per person, and that only the sponsors make that happen. And next year, WordCamp US is making its way to Nashville.</p>\n<h3>WordCamps and meetups in 2016</h3>\n<p>There were 116 WordCamps in 2016, and over 36,000 attendees, 2,056 speakers, 1,036 sponsors, and 750 organizers.</p>\n<p>There were 3,193 meetup events in 58 countries. These were attended by more than 62,000 people, or nearly double WordCamps.</p>\n<p>Matt says it&#8217;s the fastest growth there has been for these events in around five or six years. WordCamp Europe actually had more people than WordCamp US this year, which Matt took as a personal challenge for Nashville.</p>\n<p><a href=\"http://wordpress.tv/\">WordPress.tv</a> published 26% more talks this year than the previous year, and now there is an official <a href=\"https://www.youtube.com/wordpress\">WordPress channel on YouTube</a>, so more and more videos will begin to be available wherever people want to watch them.</p>\n<h3>WordCamp public benefit corporation and the WordPress Foundation</h3>\n<p>More than a year ago, work began to separate WordCamps from the <a href=\"http://wordpressfoundation.org/\">WordPress Foundation</a>, in order to make WordPress event organizing more flexible and to better protect the WordPress trademarks that the foundation holds.</p>\n<p>One of the things the foundation is going to start doing is support like minded non-profits, and in 2017 will be sponsoring three: Hack the Hood, the Internet Archive, and Black Girls Code.</p>\n<p>Also, the foundation will start to promote hackathons for non-profits and NGOs.</p>\n<h3>WordPress&#8217;s extended family</h3>\n<p>Matt gave a shoutout to WordPress&#8217;s &#8220;cousins&#8221; like BuddyPress and bbPress, highlighting a lot of features that have gone into the software in the last year.</p>\n<h4>BuddyPress and bbPress</h4>\n<p>WordPress.org itself uses BuddyPress and bbPress. For ages, it&#8217;s used outdated versions of bbPress, and in the past year launched a new support form that uses modern bbPress and WordPress profiles use bbPress. Matt says projects like these will get new support and engagement over the next year.</p>\n<h4>HackerOne</h4>\n<p>HackerOne is a security website that allows software organizations to offer bounties to hackers for responsibly disclosing security bugs.</p>\n<h4>GlotPress</h4>\n<p>GlotPress has had a big transformation in the last year, as it is no longer standalone software on top of BackPress, but rather a plugin for WordPress. If you&#8217;ve never been to <a href=\"https://translate.wordpress.org/\">translate.WordPress.org</a>, you&#8217;ve seen GlotPress in action, and it&#8217;s pretty amazing.</p>\n<h4>WordPress.org</h4>\n<p><a href=\"https://wordpress.org\">WordPress.org</a> is a central hub for the WordPress community. Matt highlighted some of the work that&#8217;s been going on this past year around languages, support forums, and more. He also says that new work will be going into P2/O2, which are used for the <a href=\"https://make.wordpress.org\">Make WordPress</a> blogs.</p>\n<p>And he gave attention to the new WordPress plugin repository, which finally uses WordPress itself, and has a whole new design. You can see the new design in action on the new <a href=\"https://wordpress.org/plugins-wp/\">demo site</a>, which should role out to the main Plugins directory soon.</p>\n<h3>WordPress in all languages</h3>\n<p>WordPress 4.6 was available in 50 languages the day it was released. And the top 10 plugins are 82% translated in the top 12 languages used in WordPress.</p>\n<p>Language packs have been a huge help in helping translate plugins as a community project on Translate.WordPress.org, rather than having to ship translations inside the plugin itself.</p>\n<p>1,598 plugins are now using language packs, and 1,224 themes use them. This is huge for the future of WordPress working great in every language.</p>\n<p>Also, in WordPress 4.7, we&#8217;ll see per-user language choices.</p>\n<h3>Learning JavaScript Deeply</h3>\n<p>Last year&#8217;s homework for the community was to learn JavaScript deeply. He says that WordPress is 28% JavaScript now, which hasn&#8217;t changed, but he says we&#8217;ve still made a lot of progress.</p>\n<p>Matt gave himself a personal challenge to learn JavaScript, and he said that 364 days into this challenge, he submitted his first patch to Calypso (Automattic&#8217;s WordPress administration interface). He said, learning JavaScript and becoming as native with JavaScript as with PHP is going to be really important &#8212; especially as the REST API gets included in WordPress 4.7.</p>\n<h3>WordPress Growth Council</h3>\n<p>Matt recently posted about a WordPress Growth Council to help WordPress grow and maintain marketshare.</p>\n<p>He says that what got WordPress to where it is today, won&#8217;t get WordPress to where it can be tomorrow. He blogged about this <a href=\"https://ma.tt/2016/12/wp-growth-council/\">new growth council</a>, which folks can apply for, which will help guide product direction in WordPress going forward.</p>\n<p>Matt actually said in Post Status Slack recently that if WordPress doesn&#8217;t make changes to the interface and otherwise, he&#8217;d expect WordPress marketshare would begin to decline by 2018.</p>\n<h3>HTTPS &amp; PHP7</h3>\n<p>11.45% of WordPress websites are now served via HTTPS. Matt talked last year about how LetsEncrypt and PHP7 were going to be a big deal, but they&#8217;ve turned out to be, &#8220;huge.&#8221; And WordPress will now start applying progressive enhancement techniques for WordPress websites.</p>\n<p>WordPress.com is now fully on PHP7, which he says was an enormous accomplishment. He&#8217;s also announced that <a href=\"https://wordpress.org/about/requirements/\">WordPress.org will now recommend</a> PHP7 by default.</p>\n<h3>Calypso</h3>\n<p>Matt gave some updates on <a href=\"https://developer.wordpress.com/calypso/\">Calypso&#8217;s</a> adoption since it was released last year. He says that 68% of posts on WordPress.com are now written in Calypso. 17% of posts are written via a mobile device, and only 15% of users are using the WordPress admin. For reference, Calypso is the default method of publishing on WordPress.com now, so that includes the desktop website, desktop app, and mobile app.</p>\n<p>Matt says that building Calypso is like, &#8220;building a plane while it&#8217;s flying.&#8221; And while it&#8217;s hard, he says it&#8217;s worth it, but it&#8217;s like rebuilding WordPress &#8212; which took 13 years to do &#8212; in only two years.</p>\n<p>The future of Calypso includes making it &#8220;plugin aware&#8221;, so that prominent plugins (most Automattic plugins included) would be recognized and manageable via Calypso.</p>\n<p>In fact, Calypso is plugin aware today, as the merge has just happened. So now plugins can include custom code to be manageable via Calypso. This is an interesting move to me, especially since Calypso &#8212; while open source &#8212; isn&#8217;t an official WordPress project, but rather an Automattic-owned interface.</p>\n<p>Matt says that someday he&#8217;s like to see Calypso, &#8220;or something like it,&#8221; eventually to become the WordPress interface.</p>\n<h3>Core releases in 2016</h3>\n<p>WordPress 4.5-4.7 will have been released by the end of 2016. Matt says, &#8220;this is very much a year about doing things differently.&#8221; And in that spirit, he&#8217;s pre-announcing the jazz musician in the release. I&#8217;m sure Jeffro will be pleased <img src=\"https://s.w.org/images/core/emoji/2.2.1/72x72/1f609.png\" alt=\"?\" class=\"wp-smiley\" /> WordPress 4.7 will be named &#8220;Vaughan&#8221;, after jazz musician Sarah &#8220;Sassy&#8221; Vaughan.</p>\n<p>Helen Hou-Sandi came to the stage to discuss WordPress 4.7 in more detail.</p>\n<h3>WordPress 4.7</h3>\n<p>WordPress 4.7 will include a variety of features, and will be released on Tuesday, December 6th.</p>\n<h4>New default theme</h4>\n<p>WordPress includes a new default theme that with a multi-section home page that&#8217;s a brand new WordPress feature. And generally Twenty Seventeen has a lot more broad base appeal for businesses and non-blogging applications than many past themes.</p>\n<h4>Theme setup process</h4>\n<p>Helen really wanted to focus on user interactions in WordPress 4.7. She used the example of her &#8220;tweet storm&#8221; about what it&#8217;s like to change a theme, which took dozens of steps and included a lot of unclear processes.</p>\n<p>Themes in 4.7 can define content that ships with the theme, such as a nav menu setup, sample page content, a password protected page, and other content that would be utilized in the theme. This will be a massive improvement in the initial theme setup experience that I love to see in 4.7.</p>\n<h4>Better menu handling</h4>\n<p>WordPress 4.7 includes better menu building that will also assist the new user experience. Now when you are building a menu in the customizer, you can add a page right from the menu screen, so that if you haven&#8217;t yet written your &#8220;about&#8221; page or whatever else, you&#8217;ll be able to create that draft straight from the menu screen, so the user doesn&#8217;t have to know exactly which flow is necessary to setup their site.</p>\n<h4>&#8220;Sleeper hits&#8221;</h4>\n<p>Helen highlights sleeper features, like thumbnail previews for PDFs and user dashboard languages so a user can use a different language than is set by the site administrator.</p>\n<h4>The WordPress REST API</h4>\n<p>To big applause, Helen noted the inclusion of the WordPress REST API Content Endpoints in 4.7. She says that she&#8217;s excited to take the momentum and excitement around the API and turn it into more real-world projects where people test and put it to practice.</p>\n<h4>Deputy leads</h4>\n<p>Jeff Paul and Aaron Jorbin were the deputy release leads for 4.7, and more than 475 contributors submitted code to 4.7. Over 200 of those contributors are first time contributors.</p>\n<h4>Sneak preview video</h4>\n<p>To end the preview of WordPress 4.7, Helen shared a sneak preview of the WordPress 4.7 video, created by friend Rami Abraham, that highlights &#8220;Carly&#8221;, who is a small business owner building her business website. The video shows a couple more great sleeper hits, like customizer preview icons to help editing, and video headers.</p>\n<h4>That&#8217;s WordPress 4.7</h4>\n<p>WordPress 4.7, I believe, is going to be one of the best releases we&#8217;ve seen in a long, long time. It&#8217;s jam packed, and while I&#8217;m sure we&#8217;ll have plenty of follow-on work, there&#8217;s been a hugely ambitious effort with tons of awesome contributors. None of it would&#8217;ve happened without Helen.</p>\n<h4>WordPress REST API and examples</h4>\n<p>After the video, Matt came back on stage.</p>\n<p>Matt highlighted some of the REST API examples, including the new <a href=\"https://www.guggenheim.org/\">Guggenheim Museum</a> website and <a href=\"http://www.vocativ.com/\">Vocativ</a>, which both use the new API, and are powered by Content Endpoints.</p>\n<h3>A look at the past and future</h3>\n<p>Matt spent a few minutes reflecting over this past, and busy, year; but also spent time discussing the past few years and what&#8217;s in store in the future.</p>\n<p>Matt recognized the &#8220;predictable&#8221; release cycle that we moved to around WordPress 3.8, and how that&#8217;s been a huge benefit for the platform in general.</p>\n<p>In the past five years, we&#8217;ve seen WordPress go from 13.1% to 27.2%, and this kind of marketshare for a CMS is &#8220;unprecedented.&#8221;</p>\n<p>He says, &#8220;What can we try next?&#8221; In other words, he wants to do things differently going forward: &#8220;What got us here, won&#8217;t get us there.&#8221; In order to do this, he&#8217;s proposing a new structure for core development.</p>\n<p>Matt said he wants to see a simpler, faster UX, while simultaneously making it more powerful. This has been my number one goal for WordPress the last few years, so I&#8217;m thrilled to see him highlight it. In the coming releases, he, &#8220;wants to see design leading the way.&#8221;</p>\n<p>In 2017, Matt says he&#8217;s going to be a heavily involved project lead again.</p>\n<h3>No set major releases in 2017</h3>\n<p>Matt made a huge announcement by saying that there will be no set releases in 2017. WordPress Core will continue to move forward, managing maintenance and other items, but will shift to three main focuses for features that will dictate the next several major releases:</p>\n<h4>1) The WordPress REST API</h4>\n<p>He says we need shift from thinking about the input, to measuring the output. He wants the conversation of success metrics to get beyond the &#8220;thousands&#8221; when, &#8220;WordPress is in the tens of millions.&#8221;</p>\n<p>Matt sees powering the WordPress admin with the REST API as a core focus for 2017. In addition, this effort will include shipping authentication tools in WordPress core, so that external applications can connect to WordPress websites. He says if we can&#8217;t move forward with this goal, then we need to consider making the API a plugin again.</p>\n<h4>2) The Editor</h4>\n<p>Matt wants to see a lot of work on the WordPress editing experience. Matt says he showed &#8220;block-baced editor&#8221; (some may remember this as &#8220;content blocks&#8221;) in a State of the Word slide a few years ago, and calls the WordPress editor his &#8220;white whale&#8221;.</p>\n<p>He says we need to be candid about our shortcomings with WordPress so that we can more effectively move forward. Andrew Ozz and Ella Iseulde Van Dorpe have been massively influential on the editor improvements we&#8217;ve seen over the past few years, and their contributions will be huge for moving this goal forward.</p>\n<h4>3) The Customizer</h4>\n<p>&#8220;The customizer is not yet fast enough, and flexible enough, to meet our current needs.&#8221; He&#8217;s excited to see all the new work going into the customizer, but knows there&#8217;s a lot of work to do to take the customizer to the next step.</p>\n<h3>How to get these goals accomplished</h3>\n<p>He says that new major versions of WordPress will not be released until these features are ready. He says that as each project is completed, there will be a major release to go around it.</p>\n<p>I&#8217;m fascinated by this new approach. It&#8217;s like taking the current feature project framework and taking it multiple levels up. It&#8217;s definitely a way to shake things up, and that may be great, considering so many people in the WordPress space enjoy complaining about the slow process that is WordPress feature development.</p>\n<p>Matt, as project lead, says he&#8217;ll personally be taking these on as the lead. And work will begin immediately to make it happen.</p>\n<p>So, I don&#8217;t know if the next release will be called WordPress 4.8, or when it will be, but I&#8217;d be shocked if it&#8217;s four months like past releases. But I guess we&#8217;ll see a lot of minor releases for all the other aspects of core development.</p>\n<p>Matt says he thinks we&#8217;ll fall while we learn to walk in this new way, and that&#8217;s okay.</p>\n<hr />\n<p>I have to admit, these are some pretty surprising announcements. I&#8217;m excited to dig more into the particulars over the coming weeks, but I do think this serves as a worthwhile and important jolt into WordPress core development. That&#8217;s not to say I think WordPress development has been bad, I think it&#8217;s been great.</p>\n<p>Matt finished by reading a poem by Elizabeth Alexander, titled, &#8220;<a href=\"https://www.poetryfoundation.org/poems-and-poets/poems/detail/52141\">Praise Song For The Day</a>&#8221; that marked a fitting end to the talk.</p>\n<p>I think the key takeaway should be like he said: &#8220;what got us here, won&#8217;t get us there.&#8221; Let&#8217;s see how this goes.</p>\n<p><em>Photo credit: Brian Richards for Post Status.</em></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 03 Dec 2016 22:20:17 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:49;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:26:\"Matt: WordCamp Live Stream\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=46945\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s: