tem','',0),(71,1,'2016-03-02 04:27:36','2016-03-02 04:27:36','','Meditation Timers','','publish','closed','closed','','meditation-timers-2','','','2016-08-26 01:19:39','2016-08-26 01:19:39','',0,'http://localhost:8080/?p=71',17,'nav_menu_item','',0),(72,1,'2016-03-02 04:27:36','2016-03-02 04:27:36','','Sati Center','','publish','closed','closed','','sati-center-2','','','2016-08-26 01:19:39','2016-08-26 01:19:39','',0,'http://localhost:8080/?p=72',18,'nav_menu_item','',0),(73,1,'2016-08-26 01:09:37','2016-08-26 01:09:37','The Insight Meditation Center is a community-based, urban refuge for the teachings and practice of insight (mindfulness, vipassana) meditation. We offer Buddhist teachings in clear, accessible and open-handed ways.\r\n\r\nGuided by Gil Fronsdal and Andrea Fella, IMC offers a broad range of programs and community activities. These include a weekly schedule of meditation sessions, dharma talks (talks on Buddhist teachings and practice) and yoga classes. In addition, we offer introductory classes in mindfulness meditation, youth programs, affinity groups, year-long study programs and residential meditation retreats through our retreat center, <a href=\"http://www.insightretreatcenter.org/\">Insight Retreat Center</a> in Santa Cruz, CA.\r\n\r\nIMC welcomes anyone and everyone who has an interest in the teachings and practices we offer. We aspire for our community to represent the wide range of diversity found in our society. IMC is intended to be a spiritual home for everyone who practices here.\r\n\r\nIMC does not require payment for any of our teachings, programs or events. The support of our teachers and center expenses is done through voluntary donations from the community. All the work in running and maintaining IMC and its programs is done by volunteers. We are inspired by how effectively mindfulness practice unfolds when it does so in a field of goodwill, generosity and gratitude.\r\n\r\nIMC began in 1986 as a gathering of individuals who met in order to learn, support and deepen their mindfulness practice. Under the guidance of Gil Fronsdal the group grew, becoming incorporated in 1997 and purchasing our current location in 2001. Currently, the guiding teachers are Gil Fronsdal and Andrea Fella. More information about our history can be found <a href=\"A5%2520-%2520History%2520of%2520IMC.docx\">here</a>. Information about our teachers can be found <a href=\"http://www.insightmeditationcenter.org/teachers/\">here</a>.\r\n\r\nWe are located in Redwood City, California, on the edge of Silicon Valley, about 20 miles south of San Francisco. We are a non-residential center.','About IMC','','publish','closed','closed','','about-imc','','','2016-08-26 01:09:37','2016-08-26 01:09:37','',0,'http://localhost:8080/?page_id=73',0,'page','',0),(74,1,'2016-08-26 01:09:37','2016-08-26 01:09:37','The Insight Meditation Center is a community-based, urban refuge for the teachings and practice of insight (mindfulness, vipassana) meditation. We offer Buddhist teachings in clear, accessible and open-handed ways.\r\n\r\nGuided by Gil Fronsdal and Andrea Fella, IMC offers a broad range of programs and community activities. These include a weekly schedule of meditation sessions, dharma talks (talks on Buddhist teachings and practice) and yoga classes. In addition, we offer introductory classes in mindfulness meditation, youth programs, affinity groups, year-long study programs and residential meditation retreats through our retreat center, <a href=\"http://www.insightretreatcenter.org/\">Insight Retreat Center</a> in Santa Cruz, CA.\r\n\r\nIMC welcomes anyone and everyone who has an interest in the teachings and practices we offer. We aspire for our community to represent the wide range of diversity found in our society. IMC is intended to be a spiritual home for everyone who practices here.\r\n\r\nIMC does not require payment for any of our teachings, programs or events. The support of our teachers and center expenses is done through voluntary donations from the community. All the work in running and maintaining IMC and its programs is done by volunteers. We are inspired by how effectively mindfulness practice unfolds when it does so in a field of goodwill, generosity and gratitude.\r\n\r\nIMC began in 1986 as a gathering of individuals who met in order to learn, support and deepen their mindfulness practice. Under the guidance of Gil Fronsdal the group grew, becoming incorporated in 1997 and purchasing our current location in 2001. Currently, the guiding teachers are Gil Fronsdal and Andrea Fella. More information about our history can be found <a href=\"A5%2520-%2520History%2520of%2520IMC.docx\">here</a>. Information about our teachers can be found <a href=\"http://www.insightmeditationcenter.org/teachers/\">here</a>.\r\n\r\nWe are located in Redwood City, California, on the edge of Silicon Valley, about 20 miles south of San Francisco. We are a non-residential center.','About IMC','','inherit','closed','closed','','73-revision-v1','','','2016-08-26 01:09:37','2016-08-26 01:09:37','',73,'http://localhost:8080/?p=74',0,'revision','',0),(75,1,'2016-08-26 01:12:48','2016-08-26 01:12:48',' ','','','publish','closed','closed','','75','','','2016-08-26 01:19:39','2016-08-26 01:19:39','',0,'http://localhost:8080/?p=75',2,'nav_menu_item','',0),(76,1,'2016-08-26 01:19:11','2016-08-26 01:19:11','<h3>Attending an event or program at IMC</h3>\r\nOur building is primarily made up of two large rooms and two smaller rooms. We first enter into a large â€œcommunity hallâ€ which we use for walking meditation, social gatherings, and for spillover seating for our meditation hall. To your immediate right are the shoe racks where shoes are left before entering the meditation hall. On top of the shoe rack, we store a number meditation cushions that anyone can use while at IMC. Our meditation hall is the large carpeted room next to the shoe racks. It has about 60 chairs for those who prefer to meditate while sitting in a chair.\r\n\r\nIf you arrive late, we ask that you enter mindfully and quietly take a seat in the community hall until the end of the meditation session.\r\n<h3>No Cost and No Registration</h3>\r\nIMC does not require payment for any of our classes, events or website offerings. IMC is supported entirely by donations [<a href=\"http://www.insightmeditationcenter.org/about-imc/#finances\">learn more</a>]. It is in the spirit of generosity that IMC continues a 2500-year-old Buddhist tradition of providing the teachings freely to all who are interested. We are inspired by how beautifully Buddhist practice develops when it does so in a field of generosity and gratitude; we are grateful for all the support we receive. If you are inspired to donate at IMC there is a donation box by the front door. It has two slots, one for the teacher of the event and the other for IMCâ€™s operation expenses. In addition, you can donate online <a href=\"http://www.insightmeditationcenter.org/donate/\">here</a>.\r\n\r\nIn general, noÂ registration is required for IMC events and programs. The occasional events that require registration will be clearly marked on our website and newsletter.\r\n<h3>Dress</h3>\r\nThere are no dress requirements; however, we encourage participants to wear comfortable clothing. No shoes are worn in the carpeted meditation hall or conference room. Shoes are OK in the community hall and other non-carpeted areas.\r\n<h3>Accessibility</h3>\r\nIMC is accessible to individuals with disabilities. Among the services offered are:\r\n<ul>\r\n	<li>One accessible parking space in our very small parking lot on Birch Street</li>\r\n	<li>There is a ramp from the parking area to the front entrance</li>\r\n	<li>The main halls and a bathroom are wheelchair accessible</li>\r\n	<li>Hearing assisted devices are available in a box on the cabinets to the left of the entry to the meditation hall. When you are finished using the hearing assisted devices, please return them to the charging box so they can be ready for our next event.</li>\r\n</ul>\r\n<h3>IMC is Fragrance-free</h3>\r\nTo respect of those with sensitivities and allergies, we request that you not wear scented products while attending IMC.\r\n<h3>Manager</h3>\r\nThere is generally a manager for each of our programs. This volunteer is usually the person who rings the bell at the end of the meditation session. The manager can answer questions you may have about IMC or about participating in our programs.\r\n<h3>Bowing</h3>\r\nMany people who participate at IMC bow at the end of a meditation session and at the end of a dharma talk. Most commonly this is an expression of appreciation and gratitude. Bowing is entirely optional.\r\n<h3>Newsletter</h3>\r\nOur <a href=\"http://www.insightmeditationcenter.org/books-articles/newsletter\">newsletter</a> includes articles relevant to practice, the current schedule and general news about IMC.\r\n\r\n&nbsp;','Information for Newcomers','','publish','closed','closed','','information-for-newcomers','','','2016-08-26 01:19:11','2016-08-26 01:19:11','',0,'http://localhost:8080/?page_id=76',0,'page','',0),(77,1,'2016-08-26 01:19:11','2016-08-26 01:19:11','<h3>Attending an event or program at IMC</h3>\r\nOur building is primarily made up of two large rooms and two smaller rooms. We first enter into a large â€œcommunity hallâ€ which we use for walking meditation, social gatherings, and for spillover seating for our meditation hall. To your immediate right are the shoe racks where shoes are left before entering the meditation hall. On top of the shoe rack, we store a number meditation cushions that anyone can use while at IMC. Our meditation hall is the large carpeted room next to the shoe racks. It has about 60 chairs for those who prefer to meditate while sitting in a chair.\r\n\r\nIf you arrive late, we ask that you enter mindfully and quietly take a seat in the community hall until the end of the meditation session.\r\n<h3>No Cost and No Regis