e first right onto Whipple.</li>\r\n	<li>Go west (Right) .6 mile.</li>\r\n	<li>Â Turn left on El Camino Real (south).</li>\r\n	<li>Make the first right onto Hopkins Avenue. Go 2 blocks.</li>\r\n	<li>IMC is located at the corner of Birch and Hopkins.</li>\r\n</ul>\r\n</td>\r\n<td width=\"50%\"><strong>From Highway 280</strong>:from the North â€“ San Francisco\r\n<ul>\r\n	<li>Take the Edgewood Road exit â€“ go left on Edgewood Road â€“ 2.3 miles.</li>\r\n	<li>Turn right on Alameda de las Pulgas â€“ 0.2 miles.</li>\r\n	<li>Turn left on Hopkins Ave.- 0.9 miles.</li>\r\n	<li>IMC is located at the corner of Birch and Hopkins on your right.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td><strong>From Highway 101:</strong>from the South â€“ Palo Alto/San Jose\r\n<ul>\r\n	<li>Take Whipple Road exit.</li>\r\n	<li>Go Left .6 mile.</li>\r\n	<li>Turn left on El Camino Real (south).</li>\r\n	<li>Make the first right onto Hopkins Avenue. Go 2 blocks.</li>\r\n	<li>Â IMC is located at the corner of Birch and Hopkins</li>\r\n</ul>\r\n</td>\r\n<td><strong>From Highway 280:</strong>from the South â€“ Palo Alto/San Jose\r\n<ul>\r\n	<li>Take Farm Hill Road exit and go east. Farm Hill Road becomes Jefferson Avenue. About 3 miles.</li>\r\n	<li>Turn left on El Camino Real (north). Go 5 blocks.</li>\r\n	<li>Turn left on Hopkins Avenue. Go 2 blocks.</li>\r\n	<li>IMC is located at the corner of Birch and Hopkins.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h2>Parking at IMC</h2>\r\n<ul>\r\n	<li>IMC has a tiny parking lot that only accommodates one or two cars, including an accessible parking spot.</li>\r\n	<li>Street parking is available. If able to, please park away from the center to accommodate those who may need to walk shorter distances.</li>\r\n	<li>The lot kitty-corner from IMC (Manzo Dental on Hopkins) is open to our members on evenings and weekends.</li>\r\n	<li>The large lot behind 160 Birch Avenue (next to the VA center at 2946 Broadway) is available to us on Sundays 