oms. We first enter into a large â€œcommunity hallâ€ which we use for walking meditation, social gatherings, and for spillover seating for our meditation hall. To your immediate right are the shoe racks where shoes are left before entering the meditation hall. On top of the shoe rack, we store a number meditation cushions that anyone can use while at IMC. Our meditation hall is the large carpeted room next to the shoe racks. It has about 60 chairs for those who prefer to meditate while sitting in a chair.\r\n\r\nIf you arrive late, we ask that you enter mindfully and quietly take a seat in the community hall until the end of the meditation session.\r\n<h3>No Cost and No Registration</h3>\r\nIMC does not require payment for any of our classes, events or website offerings. IMC is supported entirely by donations [<a href=\"http://www.insightmeditationcenter.org/about-imc/#finances\">learn more</a>]. It is in the spirit of generosity that IMC continues a 2500-year-old Buddhist tradition of providing the teachings freely to all who are interested. We are inspired by how beautifully Buddhist practice develops when it does so in a field of generosity and gratitude; we are grateful for all the support we receive. If you are inspired to donate at IMC there is a donation box by the front door. It has two slots, one for the teacher of the event and the other for IMCâ€™s operation expenses. In addition, you can donate online <a href=\"http://www.insightmeditationcenter.org/donate/\">here</a>.\r\n\r\nIn general, noÂ registration is required for IMC events and programs. The occasional events that require registration will be clearly marked on our website and newsletter.\r\n<h3>Dress</h3>\r\nThere are no dress requirements; however, we encourage participants to wear comfortable clothing. No shoes are worn in the carpeted meditation hall or conference room. Shoes are OK in the community hall and other non-carpeted areas.\r\n<h3>Accessibility</h3>\r\nIMC is accessible to individuals with disabilities. Among the services offered are:\r\n<ul>\r\n	<li>One accessible parking space in our very small parking lot on Birch Street</li>\r\n	<li>There is a ramp from the parking area to the front entrance</li>\r\n	<li>The main halls and a bathroom are wheelchair accessible</li>\r\n	<li>Hearing assisted devices are available in a box on the cabinets to the left of the entry to the meditation hall. When you are finished using the hearing assisted devices, please return them to the charging box so they can be ready for our next event.</li>\r\n</ul>\r\n<h3>IMC is Fragrance-free</h3>\r\nTo respect of those with sensitivities and allergies, we request that you not wear scented products while attending IMC.\r\n<h3>Manager</h3>\r\nThere is generally a manager for each of our programs. This volunteer is usually the person who rings the bell at the end of the meditation session. The manager can answer questions you may have about IMC or about participating in our programs.\r\n<h3>Bowing</h3>\r\nMany people who participate at IMC bow at the end of a meditation session and at the end of a dharma talk. Most commonly this is an expression of appreciation and gratitude. Bowing is entirely optional.\r\n<h3>Newsletter</h3>\r\nOur <a href=\"http://www.insightmeditationcenter.org/books-articles/newsletter\">newsletter</a> includes articles relevant to practice, the current schedule and general news about IMC.\r\n\r\n&nbsp;','Information for Newcomers','','inherit','closed','closed','','82-revision-v1','','','2016-09-15 18:58:24','2016-09-15 18:58:24','',82,'http://localhost:8080/?p=83',0,'revision','',0),(84,1,'2016-09-15 18:58:55','2016-09-15 18:58:55',' ','','','publish','closed','closed','','84','','','2016-09-15 18:58:55','2016-09-15 18:58:55','',0,'http://localhost:8080/?p=84',2,'nav_menu_item','',0),(85,1,'2016-09-15 20:01:20','2016-09-15 20:01:20','<h2>Guiding Teachers</h2>\r\n<h2></h2>\r\n<h3>Gil Fronsdal</h3>\r\nGil is the founding teacher, and a co-guiding teacher at the Insight Meditation Center in Redwood City, California and the Insight Retreat Center in Santa Cruz, California. He has been teaching since 1990. Gil has practiced Zen and Vipassana since 1975 and has a Ph.D. in Buddhist Studies from Stanford. He is a husband and father of two boys.\r\n\r\n&nbsp;\r\n<h3>Andrea Fella</h3>\r\nAndrea is a co-guiding teacher at the Insight Meditation Center and the Insight Retreat Center. She has been practicing Insight Meditation since 1996, and teaching Insight Meditation since 2003. She is particularly drawn to intensive retreat practice, and has done a number of long retreats, both in the United States and in Burma. During one long practice period in Burma, she ordained as a nun with Sayadaw U Janaka. Andrea is especially drawn to the wisdom teachings of the Buddha. Her teachings emphasize clarity and practicality. Andrea is also on the Governing Teachers Council at Spirit Rock, and she teaches residential retreats for IMC and other retreat centers around the country\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h2>Dharma Teachers</h2>\r\n<h3>Max Erdstein</h3>\r\nMax started practicing with IMC in 1999 just after graduating from Stanford. He has practiced Vipassana and Zen in America, Japan, Thailand, and Burma. He studied Buddhist chaplaincy with the Sati Center. He was trained as a Dharma teacher by Gil Fronsdal and is a graduate of the Spirit Rock teacher training program. With Gil he taught the first weeklong retreat at IRC in November 2012. He is a husband and father of two girls.\r\n\r\n&nbsp;\r\n<h3>Ines Freedman</h3>\r\nInes first became interested in meditation through her yoga practice in 1970. She has been practicing Buddhist meditation since 1985, with Gil Fronsdal being her primary teacher. She is a member of the IMC Chaplaincy Council and is past Managing Director of IMC. She directs and teaches IMCâ€™s Online Meditation Courses. She has experience with long meditation retreats including extended self-retreats, and has a special interest in working with meditation practices for those with chronic pain. She currently serves as Managing Director for the <a href=\"http://www.insightretreatcenter.org/\">Insight Retreat Center.</a> She is a retired chiropractor.\r\n\r\n&nbsp;\r\n<h3>Nikki Mirghafori</h3>\r\nNikki Mirghafori has practiced in the Theravada tradition since 2003, with a persistent interest in intensive retreat practice. She received authorization from the Burmese meditation master Venerable Pa Auk Sayadaw to teach jhanas and a detailed analytical method of vipassana in 2008. She is both a Stanford-trained compassion cultivation instructor, and a UCLA-trained mindfulness facilitator. Invited by Jack Kornfield and mentored by Gil Fronsdal &amp; Guy Armstrong, she is a graduate of the Spirit Rock/IMS/IMC Teacher Training. She holds a PhD in computer science from UC Berkeley, engaging in daily life practice as a research scientist in academia.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h2>Local Dharma Leaders</h2>\r\n&nbsp;\r\n<h3>Mick Bennett - Life-threatening Support Group and Chronic Illness Support Group</h3>\r\n&nbsp;\r\n<h3>Andrea Castillo â€“ Dharma en EspaÃ±ol Sitting Group</h3>\r\nAndrea Castillo, born in Mexico City, has practiced Insight Meditation since 1998 under the guidance of Gil Fronsdal. Andrea has taught Dharma in Spanish at IMC since 2011 and more recently at Against the Stream in SF, and at Insight Santa Cruz. She completed a Ph.D. in the Humanities at Stanford University in 2009; she is also a graduate of the Sati Center Chaplaincy Training Program, and of the Dharma Mentoring Training Program taught by Gil Fronsdal and Andrea Fella. Andrea has served the Insight community by being on the board of the Buddhist Insight Network, and presently at the IMC board. She also teaches mindfulness in English and Spanish to various populations in the Bay Area.\r\n\r\n&nbsp;\r\n<h3>Diana Clark â€“ Introduction to Mindfulness Meditation Course</h3>\r\nDiana teaches graduate-level courses on Theravada Buddhism at the Institute of Buddhist Studies in Berkeley and Introduction to Meditation at IMC. She has cumulatively spent more than a year in silent meditation retreats, has a Masterâ€™s degree in Buddhist Studies and is a graduate of the Sati Center Buddhist Chaplaincy program. She is also trained as a scientist and serves the dharma community by being the former treasurer of IMC, the current treasurer of IRC and on the board of the Buddhist Insight Network.\r\n\r\n&nbsp;\r\n<h3>Chris Clifford â€“ Online Meditation Course and Eightfold Path Program</h3>\r\nChris Clifford has practiced meditation at IMC and other Insight centers since 1995. In her own practice and teaching she emphasizes the integration of regular meditation practice with mindfulness in daily life. She also values the opportunities she has had to sit many long retreats. She is a former software engineer. Currently she manages retreats for The Mountain Hermitage in New Mexico and volunteers tutoring ESL and offering basic meditation instruction in California.\r\n\r\n&nbsp;\r\n<h3>Bruni Davila â€“ Introduction to Mindfulness Meditation Course</h3>\r\nBruni DÃ¡vila has practiced Vipassana, and Zen(in various traditions) since 1995 and at IMC since 2006, with Gil Fronsdal as her primary teacher. She is a graduate from the Sati Center Buddhist Chaplaincy Training and the IMC Dharma Mentoring Program. In her livelihood, she manages environmental projects.\r\n\r\n&nbsp;\r\n<h3>Tom Fenner - Introduction to Mindfulness Meditation Course</h3>\r\nTom Fenner is a long-time meditator, and has been affiliated with IMC since 2011. He is a graduate of the Mindfulness Training Instituteâ€™s teacher training program. A practicing attorney, Tom has taught introduction to mindfulness meditation courses for law students. He is a participant in IMCâ€™s Dharma Mentor Training Program led by Gil Fronsdal and Andrea Fella.\r\n\r\n&nbsp;\r\n<h3>Berget Jelane â€“ San Jose Sangha</h3>\r\nBerget has been a student of the Dharma since 1986. Â She is a graduate Â of the SRMC Community Dharma Leaders Program and the Sati Center Â Chaplaincy Training. Â  Recently, she was ordained by Gil as a lay Buddhist minister. As a psychotherapist, she uses mindfulness and other Buddhist principles in her work with people.\r\n\r\n&nbsp;\r\n<h3>Jennifer Lemas â€“ Buddhist Recovery Group</h3>\r\nJennifer is an ordained Theravada, Buddhist Lay Minister. She has been practicing Vipassana meditation since 1997, with Gil Fronsdal as her guiding teacher. She is a graduate of the Sati Center Buddhist Chaplaincy Program and Upayaâ€™s Buddhist Chaplaincy Program and is currently in Spirit Rock\'s Dedicated Practitioners Program. Jennifer has served as a chaplain/volunteer chaplain since 2010 at Bay Area Hospitals including Sequoia Hospital, San Francisco General and Mills Peninsula Hospital. She also leads the Buddhism and Recovery group at IMC.\r\n\r\n&nbsp;\r\n<h3>Terry Lesser <strong>â€“</strong> <strong>Yoga for Meditation</strong></h3>\r\nTerry has been teaching classes and retreats at the Insight Meditation Center since 1995. She began practicing yoga in 1984, and has been a student of Vipassana meditation since 1992. Trained in Iyengar style yoga, she also teaches at the California Yoga Center in Palo Alto. Her teaching is gentle, supportive, and sensitive to individual abilities.\r\n\r\n&nbsp;\r\n<h3>Liz Powell â€“ Introduction to Mindfulness Meditation Course</h3>\r\nLiz Powell is IMCâ€™s family programs leader. She has been practicing Vipassana meditation since 2004. She emphasizes mindfulness in daily life in her work as a Marriage Family Therapist, and enjoys retreat practice as well. Since 1996, Liz has worked with children, teens, and adults, first as a court-appointed special advocate for children, then as Director of Youth and Family Services for Kara, a non-profit peer support agency providing services for people and organizations dealing with a terminal illness or death. She currently serves as an IMC board member.\r\n\r\n&nbsp;\r\n<h3>Maria Straatmann â€“ Online Meditation Course</h3>\r\nA retired scientist and businesswoman, has studied in the Vipassana tradition with Gil Fronsdal since 1996. Maria serves as IMC Audiodharma Online Courses Coordinator/Teacher, and on its Chaplaincy Council; she is a Spirit Rock Buddhist Ritual Minister. She emphasizes freedom through seeing things as they are and letting go of unskillful mind habits, on the cushion and especially in daily life.\r\n\r\n&nbsp;\r\n<h3>Tanya Wiser â€“ Introduction to Mindfulness Meditation Course</h3>\r\nTanya Wiser began her formal meditation practice in 2005 immediately following her first Vipassana retreat. She found the practice to be deeply healing and, because she works as a therapist, she wanted to share Mindfulness with her clients so in 2008 she was trained in Mindfulness Based Cognitive Therapy as well as Mindfulness Based Relapse Prevention. In 2011 she joined IMC\'s Dedicated Practitioners Program (DPP4) and began to study the Dharma formally. In 2014 she completed her first month long Vipassana retreat and in 2016 completed IMC\'s Dharma Mentor Training Program. She is a student of both Gil Fronsdal and Andrea Fella.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h2>Family and Youth Programs</h2>\r\n&nbsp;\r\n<h3>Hilary Borison â€“ Dharma Bodhis Middle School Program</h3>\r\nHilary is a recent graduate of the Mindful Self-Compassion Teacher Training through the UCSD Center for Mindfulness, and a graduate of the Chaplaincy Program through the Sati Center, applying both in her work as a grief counselor with Kara in Palo Alto. She is currently enrolled in the Dharma Mentoring Training Program at IMC and serves a mentor in the Eightfold Path Program. Hilary teaches the Dharma Bodhis middle school program, and co-facilitates the Women\'s Circle of Mindfulness. She has been a student of Gil Fronsdal\'s since 2004.\r\n\r\n&nbsp;\r\n<h3>Carla Brooks â€“ Dharma Sprouts</h3>\r\n<h3>Liz Powell â€“ Family Program Leader</h3>\r\nLiz Powell is IMCâ€™s family programs leader. She has been practicing Vipassana meditation since 2004. She emphasizes mindfulness in daily life in her work as a Marriage Family Therapist, and enjoys retreat practice as well. Since 1996, Liz has worked with children, teens, and adults, first as a court-appointed special advocate for children, then as Director of Youth and Family Services for Kara, a non-profit peer support agency providing services for people and organizations dealing with a terminal illness or death. She currently serves as an IMC board member.\r\n\r\n&nbsp;\r\n<h3>Nirali Shah â€“ Dharma Teens</h3>','Teachers and Dharma Leaders','','publish','closed','closed','','teachers-and-dharma-leaders','','','2016-09-15 20:01:20','2016-09-15 20:01:20','',0,'http://localhost:8080/?page_id=85',0,'page','',0),(86,1,'2016-09-15 20:01:20','2016-09-15 20:01:20','<h2>Guiding Teachers</h2>\r\n<h2></h2>\r\n<h3>Gil Fronsdal</h3>\r\nGil is the founding teacher, and a co-guiding teacher at the Insight Meditation Center in Redwood City, California and the Insight Retreat Center in Santa Cruz, California. He has been teaching since 1990. Gil has practiced Zen and Vipassana since 1975 and has a Ph.D. in Buddhist Studies from Stanford. He is a husband and father of two boys.\r\n\r\n&nbsp;\r\n<h3>Andrea Fella</h3>\r\nAndrea is a co-guiding teacher at the Insight Meditation Center and the Insight Retreat Center. She has been practicing Insight Meditation since 1996, and teaching Insight Meditation since 2003. She is particularly drawn to intensive retreat practice, and has done a number of long retreats, both in the United States and in Burma. During one long practice period in Burma, she ordained as a nun with Sayadaw U Janaka. Andrea is especially drawn to the wisdom teachings of the Buddha. Her teachings emphasize clarity and practicality. Andrea is also on the Governing Teachers Council at Spirit Rock, and she teaches residential re