11 she joined IMC\'s Dedicated Practitioners Program (DPP4) and began to study the Dharma formally. In 2014 she completed her first month long Vipassana retreat and in 2016 completed IMC\'s Dharma Mentor Training Program. She is a student of both Gil Fronsdal and Andrea Fella.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h2>Family and Youth Programs</h2>\r\n&nbsp;\r\n<h3>Hilary Borison â€“ Dharma Bodhis Middle School Program</h3>\r\nHilary is a recent graduate of the Mindful Self-Compassion Teacher Training through the UCSD Center for Mindfulness, and a graduate of the Chaplaincy Program through the Sati Center, applying both in her work as a grief counselor with Kara in Palo Alto. She is currently enrolled in the Dharma Mentoring Training Program at IMC and serves a mentor in the Eightfold Path Program. Hilary teaches the Dharma Bodhis middle school program, and co-facilitates the Women\'s Circle of Mindfulness. She has been a student of Gil Fronsdal\'s since 2004.\r\n\r\n&nbsp;\r\n<h3>Carla Brooks â€“ Dharma Sprouts</h3>\r\n<h3>Liz Powell â€“ Family Program Leader</h3>\r\nLiz Powell is IMCâ€™s family programs leader. She has been practicing Vipassana meditation since 2004. She emphasizes mindfulness in daily life in her work as a Marriage Family Therapist, and enjoys retreat practice as well. Since 1996, Liz has worked with children, teens, and adults, first as a court-appointed special advocate for children, then as Director of Youth and Family Services for Kara, a non-profit peer support agency providing services for people and organizations dealing with a terminal illness or death. She currently serves as an IMC board member.\r\n\r\n&nbsp;\r\n<h3>Nirali Shah â€“ Dharma Teens</h3>','Teachers and Dharma Leaders','','inherit','closed','closed','','85-revision-v1','','','2016-09-15 20:01:20','2016-09-15 20:01:20','',85,'http://localhost:8080/?p=86',0,'revision','',0),(87,1,'2016-09-15 20:01:43','2016-09-15 20:01:43',' ','','','publish','closed','closed','','87','','','2016-09-15 20:01:43','2016-09-15 20:01:43','',0,'http://localhost:8080/?p=87',1,'nav_menu_item','',0),(88,1,'2016-09-15 20:03:32','2016-09-15 20:03:32','No Cost â€“ No Registration. In general, registration is not required to participate in IMCâ€™s offerings. Although there is no cost for any of our programs, we are grateful forÂ <a href=\"http://www.insightmeditationcenter.org/donate/\">donations</a> to support our activities and teachers.\r\n\r\nSessions start with silent, seated meditation, followed by a dharma talk (talk on Buddhist teachings and practice). For the name of any guest speaker, please refer to the <a href=\"http://www.insightmeditationcenter.org/calendar/\">calendar</a>. Everyone welcome.\r\n<h2>Monday Evening Sitting and Talk</h2>\r\n<strong>7:30 to 9:00 pm</strong>\r\n\r\nA 45-minute sitting is followed by a 45-minute dharma talk. Led by Gil Fronsdal or occasional guest teachers.\r\n<h2>Tuesday Morning Sitting and Talk</h2>\r\n<strong>9:30 to 11:00 am</strong>\r\n\r\nA 35-minute sitting is followed by a talk with time for questions. Led by Andrea Fella or occasional guest teachers.\r\n<h2>TuesdayÂ Evening, Dharma in Spanish, Meditative Movement, Sitting and Talk</h2>\r\n<strong>7:00 to 9:00 pm</strong>\r\n\r\nA 30-minute meditative movement session is followed by a 30-minute sitting and a talk with time for questions. Led by Andrea Castillo or occasional guest teachers.\r\n<h2>Martes en la noche, Dharma en EspaÃ±ol, Movimiento Meditativo, MeditaciÃ³n y PlÃ¡ticaÂ 7:00 a 9:00 pm</h2>\r\n<em>30 minutos de movimiento meditativo, seguida por 30 minutos de meditaciÃ³n y una plÃ¡tica con tiempo para preguntas. Dirigido por Andrea Castillo o en ocasiones por maestros visitantes.</em>\r\n<h2>Wednesday Morning Half-Day Retreat</h2>\r\n<strong>9:30 am to 12:15 pm</strong>\r\n\r\nAlternating sitting and walking meditation. Led by Gil Fronsdal or occasional guest teachers. You may attend any part of the morning. 15-min practice discussions are available when led by Gil Fronsdal and occasionally others. Bring lunch for informal discussion afterwards.\r\n<ul>\r\n	<li>9:30 â€“ 10:15 am Sitting meditation</li>\r\n	<li>10:15 â€“ 11:00 am Walking meditation</li>\r\n	<li>11:00 â€“ 11:45 am Sitting meditation</li>\r\n	<li>11:45 â€“ 12:00 pmÂ Dharmette (Brief dharma talk)</li>\r\n	<li>12:00 â€“ 12:15 pm Mindful activity (Cleaning the center)</li>\r\n	<li>12:15 â€“ 1:00pm Informal brown bag lunch</li>\r\n</ul>\r\n<h2>Thursday Evening Sitting and Talk</h2>\r\n<strong>7:30 to 9:00 pm</strong>\r\n\r\nA 30-minute sitting is followed by a dharma talk with time for questions. Led by Andrea Fella or occasional guest teachers.\r\n<h2>Sunday Morning Sittings and Talk</h2>\r\n<strong>8:30 to 10:45 am</strong>\r\n\r\nAlternating sitting and walking meditation. Led by Gil Fronsdal or occasional guest teachers. You may attend any part of the morning.\r\n<ul>\r\n	<li>8:30 â€“ 9:10 am Sitting meditation</li>\r\n	<li>9:10 â€“ 9:25 am Walking meditation</li>\r\n	<li>9:25 â€“ 10:00 am Sitting meditation</li>\r\n	<li>10:00 â€“ 10:45 am Dharma talk</li>\r\n	<li>11:00 am, last Sunday of the month: Vegetarian potluck brunch. All are welcome.</li>\r\n</ul>\r\n<h2>At Home in the World: Dharma for People in their 20s and 30s</h2>\r\nLed by Max Erdstein and occasional guest teachers\r\n\r\nSunday Evenings (except the 2nd Sunday of the month)\r\n\r\n<strong>7:30 - 9 pm</strong>\r\n\r\nAt Home in the World is an ongoing dharma practice group addressing themes relevant to people in their 20s and 30s. It includes guided meditations, dharma talks, small and large group discussions, and social interaction. Each Sunday we have a mix of returning, regular members and new attendees. Those at any level of practice experience are very welcome.','Regular Weekly Schedule','','publish','closed','closed','','regular-weekly-schedule','','','2016-09-15 20:03:32','2016-09-15 20:03:32','',0,'http://localhost:8080/?page_id=88',0,'page','',0),(89,1,'2016-09-15 20:03:32','2016-09-15 20:03:32','No Cost â€“ No Registration. In general, registration is not required to participate in IMCâ€™s offerings. Although there is no cost for any of our programs, we are grateful forÂ <a href=\"http://www.insightmeditationcenter.org/donate/\">donations</a> to support our activities and teachers.\r\n\r\nSessions start with silent, seated meditation, followed by a dharma talk (talk on Buddhist teachings and practice). For the name of any guest speaker, please refer to the <a href=\"http://www.insightmeditationcenter.org/calendar/\">calendar</a>. Everyone welcome.\r\n<h2>Monday Evening Sitting and Talk</h2>\r\n<strong>7:30 to 9:00 pm</strong>\r\n\r\nA 45-minute sitting is followed by a 45-minute dharma talk. Led by Gil Fronsdal or occasional guest teachers.\r\n<h2>Tuesday Morning Sitting and Talk</h2>\r\n<strong>9:30 to 11:00 am</strong>\r\n\r\nA 35-minute sitting is followed by a talk with time for questions. Led by Andrea Fella or occasional guest teachers.\r\n<h2>TuesdayÂ Evening, Dharma in Spanish, Meditative Movement, Sitting and Talk</h2>\r\n<strong>7:00 to 9:00 pm</strong>\r\n\r\nA 30-minute meditative movement session is followed by a 30-minute sitting and a talk with time for questions. Led by Andrea Castillo or occasional guest teachers.\r\n<h2>Martes en la noche, Dharma en EspaÃ±ol, Movimiento Meditativo, MeditaciÃ³n y PlÃ¡ticaÂ 7:00 a 9:00 pm</h2>\r\n<em>30 minutos de movimiento meditativo, seguida por 30 minutos de meditaciÃ³n y una plÃ¡tica con tiempo para preguntas. Dirigido por Andrea Castillo o en ocasiones por maestros visitantes.</em>\r\n<h2>Wednesday Morning Half-Day Retreat</h2>\r\n<strong>9:30 am to 12:15 pm</strong>\r\n\r\nAlternating sitting and walking meditation. Led by Gil Fronsdal or occasional guest teachers. You may attend any part of the morning. 15-min practice discussions are available when led by Gil Fronsdal and occasionally others. Bring lunch for informal discussion afterwards.\r\n<ul>\r\n	<li>9:30 â€“ 10:15 am Sitting meditation</li>\r\n	<li>10:15 â€“ 11:00 am Walking meditation</li>\r\n	<li>11:00 â€“ 11:45 am Sitting meditation</li>\r\n	<li>11:45 â€“ 12:00 pmÂ Dharmette (Brief dharma talk)</li>\r\n	<li>12:00 â€“ 12:15 pm Mindful activity (Cleaning the center)</li>\r\n	<li>12:15 â€“ 1:00pm Informal brown bag lunch</li>\r\n</ul>\r\n<h2>Thursday Evening Sitting and Talk</h2>\r\n<strong>7:30 to 9:00 pm</strong>\r\n\r\nA 30-minute sitting is followed by a dharma talk with time for questions. Led by Andrea Fella or occasional guest teachers.\r\n<h2>Sunday Morning Sittings and Talk</h2>\r\n<strong>8:30 to 10:45 am</strong>\r\n\r\nAlternating sitting and walking meditation. Led by Gil Fronsdal or occasional guest teachers. You may attend any part of the morning.\r\n<ul>\r\n	<li>8:30 â€“ 9:10 am Sitting meditation</li>\r\n	<li>9:10 â€“ 9:25 am Walking meditation</li>\r\n	<li>9:25 â€“ 10:00 am Sitting meditation</li>\r\n	<li>10:00 â€“ 10:45 am Dharma talk</li>\r\n	<li>11:00 am, last Sunday of the month: Vegetarian potluck brunch. All are welcome.</li>\r\n</ul>\r\n<h2>At Home in the World: Dharma for People in their 20s and 30s</h2>\r\nLed by Max Erdstein and occasional guest teachers\r\n\r\nSunday Evenings (except the 2nd Sunday of the month)\r\n\r\n<strong>7:30 - 9 pm</strong>\r\n\r\nAt Home in the World is an ongoing dharma practice group addressing themes relevant to people in their 20s and 30s. It includes guided meditations, dharma talks, small and large group discussions, and social interaction. Each Sunday we have a mix of returning, regular members and new attendees. Those at any level of practice experience are very welcome.','Regular Weekly Schedule','','inherit','closed','closed','','88-revision-v1','','','2016-09-15 20:03:32','2016-09-15 20:03:32','',88,'http://localhost:8080/?p=89',0,'revision','',0),(90,1,'2016-09-15 20:03:48','2016-09-15 20:03:48',' ','','','publish','closed','closed','','90','','','2016-09-15 20:03:48','2016-09-15 20:03:48','',0,'http://localhost:8080/?p=90',1,'nav_menu_item','',0),(91,1,'2016-09-15 20:05:38','2016-09-15 20:05:38','No Cost â€“ No Registration. In general, registration is not required to participate in IMCâ€™s offerings. Although there is no cost for any of our programs, we are grateful forÂ <a href=\"http://www.insightmeditationcenter.org/donate/\">donations</a> to support our activities and teachers.\r\n<h2>One-hour Basic Mindfulness Meditation Instruction</h2>\r\nTaught by experienced meditators, this drop-in class teaches the basic elements of mindfulness meditation. The small class size often provides opportunities to ask individualized questions about beginning a meditation practice. Many people find it helpful to attend this class more than once. No pre-registration necessary.\r\n\r\nEvery Thursday, 6:15 â€“ 7:15 pm\r\n\r\nFirst Monday of each month, 6:15 â€“ 7:15 pm\r\n\r\nFirst Thursday of each month, 10:45 â€“ 11:45 am\r\n<h2>Five-week Introduction to Mindfulness Meditation</h2>\r\nThe basic instruction in mindfulness meditation is taught sequentially in this 5-week course. The course starts with mindfulness of breathing, followed by mindfulness of the body, emotions and thinking and concludes with a discussion on concentration and the application of mindfulness in daily life.\r\n\r\nThis course is taught several times a year by Gil Fronsdal and senior students. The frequency of the course offering and the exact dates vary each year, but in general, it starts in January, April or May, July, and October. The course dates will be announced in the <a href=\"http://www.insightmeditationcenter.org/books-articles/newsletter/\">IMC newsletter</a> and can be found on the <a href=\"http://www.insightmeditationcenter.org/calendar/\">IMC calendar</a>. In addition, when Gil Fronsdal teaches the course, the course is recorded and made available on <a href=\"http://www.audiodharma.org/series/1/talk/1762/\">audiodharma.org</a>. The weekly handouts for the course are available <a href=\"http://www.audiodharma.org/series/1/talk/1762/\">here</a>. No pre-registration necessary.\r\n<h2>Six-week Online Introduction to Mindfulness Meditation</h2>\r\nThisÂ course is based on Gil Fronsdalâ€™s six-week Introduction to Mindfulness Meditation course. The course is supplemented with written material, exercises and reflections for bringing the practice into daily life.\r\n\r\nThis course is offered entirely online. It includes five weeks ofÂ personal support offered by various teachers either by email, or at pre-arranged times, using Phone, Skype or Google Talk. Â (Gil does not offer any personal support.) The course material is not live, so it can be done at any time during the day. In addition, the course may also beÂ auditedÂ without personal teacher support. If you choose to register for teacher support, please take this commitment seriously:Â  a volunteer experienced meditator will be reserving weekly time for you. <a href=\"http://www.insightmeditationcenter.org/programs/online-courses/\">Learn more</a>\r\n<h2>One-day Introduction to Mindfulness Meditation Daylong</h2>\r\nOnce or twice a year we offer an all-day introduction to mindfulness meditation on a Saturday. The retreat format allows for a number of meditation sessions in a single day which provides an opportunity to learn how to apply the instructions. For people who have gone through the 5-week introductory series, the daylong is a great way to review the instructions and experience the benefits of a full day of practicing them. Please see the <a href=\"http://www.insightmeditationcenter.org/calendar/\">calendar</a> for dates.\r\n<h2>Four-week Beginnerâ€™s Practice Group</h2>\r\nThis course is intended for those who have already taken an introductory mindfulness meditation class and would like to take the next step in building and supporting their practice. This is a 4-week series on developing mindfulness practice that includes a 20-minute meditation, a review of basic instructions and an introduction to additional teachings that support mindfulness practice. The course is led by Chris Clifford and other senior students.\r\n\r\nIn general, the Beginners Practice Group is offered following the 5-Week Introduction to Mindfulness Course to give beginning students additional support for their burgeoning meditation practice. No pre-registration necessary.','For Beginners','','publish','closed','closed','','for-beginners','','','2016-09-15 20:05:38','2016-09-15 20:05:38','',0,'http://localhost:8080/?page_id=91',0,'page','',0),(92,1,'2016-09-15 20:05:38','2016-09-15 20:05:38','No Cost â€“ No Registration. In general, registration is not required to participate in IMCâ€™s offerings. Although there is no cost for any of our programs, we are grateful forÂ <a href=\"http://www.insightmeditationcenter.org/donate/\">donations</a> to support our activities and teachers.\r\n<h2>One-hour Basic Mindfulness Meditation Instruction</h2>\r\nTaught by experienced meditators, this drop-in class teaches the basic elements of mindfulness meditation. The small class size often provides opportunities to ask individualized questions about beginning a meditation practice. Many people find it helpful to attend this class more than once. No pre-registration necessary.\r\n\r\nEvery Thursday, 6:15 â€“ 7:15 pm\r\n\r\nFirst Monday of each month, 6:15 â€“ 7:15 pm\r\n\r\nFirst Thursday of each month, 10:45 â€“ 11:45 am\r\n<h2>Five-week Introduction to Mindfulness Meditation</h2>\r\nThe basic instruction in mindfulness meditation is taught sequentially in this 5-week course. The course starts with mindfulness of breathing, followed by mindfulness of the body, emotions and thinking and concludes with a discussion on concentration and the application of mindfulness in daily life.\r\n\r\nThis course is taught several times a year by Gil Fronsdal and senior students. The frequency of the course offering and the exact dates vary each year, but in general, it starts in January, April or May, July, and October. The course dates will be announced in the <a href=\"http://www.insightmeditationcenter.org/books-articles/newsletter/\">IMC newsletter</a> and can be found on the <a href=\"http://www.insightmeditationcenter.org/calendar/\">IMC calendar</a>. In addition, when Gil Fronsdal teaches the course, the course is recorded and made available on <a href=\"http://www.audiodharma.org/series/1/talk/1762/\">audiodharma.org</a>. The weekly handouts for the course are available <a href=\"http://www.audiodharma.org/series/1/talk/1762/\">here</a>. No pre-registration necessary.\r\n<h2>Six-week Online Introduction to Mindfulness Meditation</h2>\r\nThisÂ course is based on Gil Fronsdalâ€™s six-week Introduction to Mindfulness Meditation course. The course is supplemented with written material, exercises and reflections for bringing the practice into daily life.\r\n\r\nThis course is offered entirely online. It includes five weeks ofÂ personal support offered by various teachers either by email, or at pre-arranged times, using Phone, Skype or Google Talk. Â (Gil does not offer any personal support.) The course material is not live, so it can be done at any time during the day. In addition, the course may also beÂ auditedÂ without personal teacher support. If you choose to register for teacher support, please take this commitment seriously:Â  a volunteer experienced meditator will be reserving weekly time for you. <a href=\"http://www.insightmeditationcenter.org/programs/online-courses/\">Learn more</a>\r\n<h2>One-day Introduction to Mindfulness Meditation Daylong</h2>\r\nOnce or twice a year we offer an all-day introduction to mindfulness meditation on a Saturday. The retreat format allows for a number of meditation sessions in a single day which provides an opportunity to learn how to apply the instructions. For people who have gone through the 5-week introductory series, the daylong is a great way to review the instructions and experience the benefits of a full day of practicing them. Please see the <a href=\"http://www.insightmeditationcenter.org/calendar/\">calendar</a> for dates.\r\n<h2>Four-week Beginnerâ€™s Practice Group</h2>\r\nThis course is intended for those who have already taken an introductory mindfulness meditation class and would like to take the next step in building and supporting their practice. This is a 4-week series on developing mindfulness practice that includes a 20-minute meditation, a review of basic instructions and an introduction to additional teachings that support mindfulness practice. The course is led by Chris Clifford and other senior students.\r\n\r\nIn general, the Beginners Practice Group is offered following the 5-Week Introduction to Mindfulness Course to give beginning students additional support for their burgeoning meditation practice. No pre-registration necessary.','For Beginners','','inherit','closed','closed','','91-revision-v1','','','2016-09-15 20:05:38','2016-09-15 20:05:38','',91,'http://localhost:8080/?p=92',0,'revision','',0),(93,1,'2016-09-15 20:06:01','0000-00-00 00:00:00',' ','','','draft','closed','closed','','','','','2016-09-15 20:06:01','0000-00-00 00:00:00','',0,'http://localhost:8080/?p=93',1,'nav_menu_item','',0),(94,1,'2016-09-15 20:06:34','2016-09-15 20:06:34',' ','','','publish','closed','closed','','94','','','2016-09-15 20:06:34','2016-09-15 20:06:34','',0,'http://localhost:8080/?p=94',1,'nav_menu_item','',0),(95,1,'2016-09-15 20:08:21','2016-09-15 20:08:21','','Dharma Friends','','publish','closed','closed','','dharma-friends','','','2016-09-15 20:08:21','2016-09-15 20:08:21','',0,'http://localhost:8080/?page_id=95',0,'page','',0),(96,1,'2016-09-15 20:08:21','2016-09-15 20:08:21','','Dharma Friends','','inherit','closed','closed','','95-revision-v1','','','2016-09-15 20:08:21','2016-09-15 20:08:21','',95,'http://localhost:8080/?p=96',0,'revision','',0),(97,1,'2016-09-15 20:08:35','2016-09-15 20:08:35',' ','','','publish','closed','closed','','97','','','2016-09-15 20:08:35','2016-09-15 20:08:35'